    "content": "Jump to content From Wikipedia, the free encyclopedia Byzantine emperor from 715 to 717 This article is about the Byzantine emperor. For the 10th-century Abkhazian ruler, see Theodosius III of Abkhazia. For the pope of Alexandria, see Pope Theodosius III of Alexandria. Theodosius III Emperor of the Romans Solidus of Theodosius III. The inscription reads d n theodosius mul a. Byzantine emperor Reign c.โMay 715 โ 25 March 717 Predecessor Anastasius II Successor Leo III Died After 717, possibly on 24 July 754 Issue Theodosius Dynasty Twenty Years\u0027 Anarchy Father Tiberius III? Theodosius III (Greek: ฮฮตฮฟฮดฯฯฮนฮฟฯ, romanized: Theodรณsios) was the Byzantine emperor from c.โMay 715 to 25 March 717. Before rising to power and seizing the throne of the Byzantine Empire, he was a tax collector in Adramyttium. In 715, the Byzantine navy and the troops of the Opsician Theme, one of the Byzantine provinces, revolted against Emperor Anastasius II (r.โ713โ715), acclaiming the reluctant Theodosius as emperor. Theodosius led his troops to Chrysopolis and then Constantinople, the capital, seizing the city in November 715. Anastasius did not surrender until several months later, accepting exile in a monastery in return for safety. Many themes viewed Theodosius to be a puppet of the troops of the Opsician Theme, and his legitimacy was denied by the Anatolics and the Armeniacs under their respective strategoi (generals) Leo the Isaurian and Artabasdos. Leo declared himself emperor in the summer of 716 and allied himself with the Umayyad Caliphate, the Islamic empire; Theodosius sought aid from the Bulgarians under Khan Tervel (r.โ700โ721), setting a firm border at Thrace and ceding the Zagoria region to the Bulgarians, as well as stipulating the payment of tribute to them. Leo then marched his troops to Constantinople, seizing the city of Nicomedia, and capturing many officials, including Theodosius\u0027s son, also named Theodosius. With his son in captivity, Theodosius took the advice of Patriarch Germanus and the Byzantine Senate, and negotiated with Leo, agreeing to abdicate and recognize Leo as emperor. Leo entered Constantinople and definitively seized power on 25 March 717, allowing Theodosius and his son to retire to a monastery. Exactly when Theodosius died is uncertain, but it may have been on 24 July 754. History [edit] Background [edit] A map of the Byzantine Empire during the Twenty Years\u0027 Anarchy After the Umayyad Caliphate was repelled at the first Arab siege of Constantinople (674โ678), the Arabs and Byzantines experienced a period of peace between each other.[1] Hostilities were resumed by Byzantine Emperor Justinian II (r.โ685โ695, 705โ711), resulting in a string of Arab victories. As a consequence, the Byzantines lost control over Armenia and the Caucasian principalities, and the Arabs gradually encroached upon the Byzantine borderlands. Annually, generals from the Caliphate would launch raids into Byzantine territory, seizing fortresses and towns.[2][3][4] After 712, the defenses of the Byzantine Empire weakened, as Arab raids penetrated deeper into Byzantine Asia Minor, and Byzantine response to these raids became less common; much of the frontier became depopulated, as the inhabitants were either killed, enslaved, or driven away. A result of this was that many frontier forts, especially in Cilicia, were gradually abandoned.[5][6] The success of these raids emboldened the Arabs, who prepared for a second assault against Constantinople as early as the reign of Caliph al-Walid I (r.โ705โ715). After his death, his successor, Sulayman (r.โ715โ717) continued planning the campaign,[7][8][9] Sulayman began assembling his forces in late 716, on the plain of Dabiq, north of Aleppo, entrusting the command of these forces to his brother, Maslama ibn Abd al-Malik.[10][11] The Slavs and Bulgars also formed a growing threat to the northern frontier of the Byzantine Empire, threatening Byzantine control in the Balkans.[12] During the rule of Byzantine Emperor Philippicus (r.โ711โ713), in 712, the Bulgarians under Khan Tervel advanced as far as the walls of Constantinople itself, plundering the surrounding country, including villas and estates near the capital, where the Byzantine elites often summered.[13] Theodosius came to power during a period called the Twenty Years\u0027 Anarchy, defined by struggles between the emperors and the elites, and political instability, with a rapid succession of emperors. The nobles of this time were often natives of Asia Minor, and rarely had a strong agenda beyond preventing the emperors from growing stronger and disrupting the status quo.[14][15] The Twenty Years\u0027 Anarchy began when Emperor Justinian II was overthrown by Leontius (r.โ695โ698) in 695, ending the Heraclian dynasty, which had retained power for eighty years. During this period of anarchy, seven different emperors took the throne, including a restored Justinian for a time.[15] The modern historian Romilly Jenkins states that between 695 a",
