    "content": "Lompat ke isi Nibak Wikipedia ฺฉุฑู ุณูุงฺุชุ ูุง ุชุฑูุณ ูุชูุง ุจู ููููฺคูุฏูุง ุจูุณุง ุฃฺูู saboh รจnsiklopรจdia bibeueh nyang ban dum ureueng jeuet seumurat Jinoe ka na 13.004 seunurat nyang geusurat lรฉ 31.836 droe ureueng ngui Seunurat: Acรจh ยท Bumoe ยท Nanggroe ยท Islam ยท Bahsa ยท Agama ยท Grak tubรดh ยท Peunyakรฉt Bak Kayรจe ยท Kulat ยท Cicรฉm ยท Eungkรดt ยท Insekta ยท Mamalia ยท Endemik โโ Ban Dum Seunurat ยท Ureueng Ngui ยท Kri Seumurat ยท Teumanyรถng ยท Meusapat ยท Hareutoe Narit ยท Asoe โโ Seunurat Peunilรฉh Meuseujid Baiturrahim di Ulรจe Lheue lheueh ie beuna Iรซ beuna nan keu saboh bakat raya nyang teuka di laรดt. Di Acรจh musibah iรซ beuna nyan meukeujadian bak 26 uroรซ buleuรซn 12 thรดn 2004. Musibah nyan meukeujadian lheuรซh Geumpa bumoรซ Laรดt Hindia thรดn 2004, seugolom nyan na cit musibah iรซ beuna di Acรจh nyang keunong u wilayah pulo Simeulu thรดn 1908. Lam bahsa Simeulu iรซ beuna nyan geukheun smong, salang lam bahsa Jeupang geukheun tsunami. Iรซ beuna jeuรซt nibak meumacam cara, jeuet nibak peuรซ mantong nyang jeuet keu kacho lam iรซ laรดt nyang meugantoรซ jumeulah massa iรซ nyang rayek nibak biasajih. Runtรดh nyang raya di meuyub laรดt, nyang kayรฉm takalon \u0027oh na geumpa teuga, nyan jeuet cit keu iรซ beuna. Watรจe runtรดh bumoรซ di meuyub laรดt, muka iรซ laรดt hana lรฉ timang jiubah lรฉ lรถn nyang meugrak ngon meuiseuek ban sipanyang meuyub laรดt. (beuet lom... โ) โ Seunurat peunilรฉh awai: Qubah Ijรด - Madinah Seunurat Peunilรฉh Acรจh Dayah nakeuh salah saboh teumpat meurunoe di Acรจh. Masa away kรถn kana di Acรจh. Dayah atawa dรจah (meunurรดt lugat ureueng da\u0027irah Acรจh Rayek, asay tutรด nibak bahsa Arab: ุฒุงููุฉโ (Zฤwiyah), nyang hareutoejih sagoe, saweub bak masa Rasulullah saw. geupeurunoe umat Islam bak sagoe-sagoe meuseujid. Nan nyankeuh nyang geunguy sampoe \u0027an jinoรซ. Salang lam bhaih administrasi neugara di Indรดnรจsia keu neukheun dayah kayรฉm neugantoรซ ngon pesantren atawa pondok pesantren geupeusaban ngon neukheun nan teumpat meununtut รจleumรจe agama Islam di Indรดnรจsia khusuihjih di pulo Jawa. (lom... โ) Na neutupeue? \"... meunyo Surat An-Nisa\u0027 geupeunan ngรถn An-Nisa nyang rayek, salang Surat Ath-Thalaq geupeunan ngรถn An-Nisaโฒ nyang ubeut?\" \"... meunyo Dayah Cot Kala dayah nyang phรดn that na di Asia Teunggara, gurรจe-gurรจe seumeubeuรซt bak dayah nyan teuka di nanggroรซ Arab, Parsi ngรถn India?\" \"... meunyo narit Hindia teuka nibak Bahsa Latin: Indus. Nan aseuli Hindia Beulanda lam bahsa Beulanda nakeuh Nederlandsch Indiรซ, geuteujeumah lam bahsa Inggrรฉh seubagoรซ Hindia Beulanda?\" \"... meunyo 20% ureueng duek di Mongolia udรฉp ngon pรจng kureueng nibak US$ 1,25 tiep uroejih?\" Gamba peunilรฉh Eungkรดt brรดk babah (Priacanthus macracanthus) lam Aquarium Sendai Umino-Mori Totti | CC BY-SA 4.0 โ Peuhah ban dum gamba โ Wikipรจdia lam bahsa laรฉn Wikipรจdia bahsa Acรจh geupuphรดn bak 12 uroe Buleuen Lapan 2009. Di yup nyoe nakeuh Wikipรจdia lam bahsa nyang laรฉn: Acรจh: Gayo ยท Alas ยท Kluet ยท Singkรฉl ยท Devayan ยท Dau Batu Ruja: Batak Toba ยท Batak Mandailing ยท Minangkabau ยท Li Niha ยท Kumoring ยท Kalimantan: Banjar ยท Jawa: Betawi ยท Sunda ยท Basa Banyumasan ยท Jawa ยท Madhurรข ยท Basa Bali ยท Sulawesi: Basa Ugi ยท Bahasa Hulontalo Asia: Bahasa Indonesia ยท Bahasa Melayu ยท ุงูุนุฑุจูุฉ ยท Tรผrkรงe ยท ูุงุฑุณ ยท ุงุฑุฏู ยท เคนเคฟเคจเฅเคฆเฅ ยท เฆฌเฆพเฆเฆฒเฆพ ยท เฎคเฎฎเฎฟเฎดเฏ ยท เนเธเธข ยท Tiแบฟng Viแปt ยท ๆฅๆฌ่ช ยท ไธญๆ ยท ํ๊ตญ์ด Ierupa: English ยท franรงais ยท espaรฑol ยท portuguรชs ยท Deutsch ยท Nederlands ยท ฮฮปฮปฮทฮฝฮนฮบฮฌ ยท ััััะบะธะน Campa: Campa Barat ยท Campa Timu Proyรจk laรฉn Wikimedia lam bahsa Acรจh: Wiktionary Kamueh bibeueh Wikisource Naseukah bibeueh Wikibook Buku bibeueh Wikivoyage Peunuman Diwana Wikinews Haba bibeueh โ Dapeuta ban dum Wikipรจdia โ Wikipรจdia Wikipรจdia saboh รจnsiklopรจdia bibeueh nyang jeuet geupeusaneut, geusalรฉn, ngรถn geusipreuek lรฉ ban dum ureueng. Alhamdulillah, jinoe Wikipรจdia ka na lam basa Acรจh. Keu meuneumat bak taseumurat, neungui Kamueh AcehโIndonesia nyang jeuet neucok sinoe ngรถn sinoe. Ikรดt seumurat Tiep ureueng jeuet geuseumurat lam Wikipedia; charatjih ureueng nyan wajรฉb geuseutรถt reusam nyang ka lheueh geuteurimรถng lรฉ ban dum ureueng. Seunurat nyan beu na asai nyang jeuet tapatรฉh. Sidroe-droe ureueng h\u0027an jeuet geuseumurat nyang hana hareutoe, nyang jeuet peusakรฉt atรฉ gop, ngรถn meulanggรฉh hak karang hasรฉ buet ureueng laรฉn. Meunyo na seunurat lagรจe nyan lam Wikipedia nyoe, nyan jeuet geusampรดh lรฉ ureueng urรดh. Meunyo droeneuh peureulรจe teunulรดng, jeuet neulakรจe tulรดng bak ureueng urรดh, atawa ureueng laรฉn. Neusurat peue-peue nyang peureulรจe bak รดn marit ureueng nyan. Bรจk tuwรถ neungui tanda ~~~~ bak akhรฉ sibagoe tanda jaroe droeneuh, mangat ureueng nyan geuturi soe nyang lakรจe tulรดng. Bรดh jak taseumurat! Kamoe muprรจh seunurat droeneuh lam Wikipรจdia basa Acรจh. Meusapat Jinoe ka na 62 droe ureueng ngui lam Wikipรจdia basa Acรจh. Neubantu ureueng nyan ngรถn neupeurรดh droeneuh lam dapeuta ureueng nyang kayรฉm seumurat lam Wikipรจdia basa Acรจh. Dapeuta jinoe! Ka na akun? Tamรถng sinoe. Jak taseumurat Ie bu peudah (id, Teujeumah!) Rangkang (id) Nanggroe Daya (id) Nanggroe Pidie (id, Teujeumah!) Nanggroe Peureulak (id, Teujeumah!) Kuwah pliek u (id) Nanggroe Teumieng",
