    "title": "Wikipedia, ti nawaya nga ensiklopedia",
    "content": "Jump to content Manipud iti Wikipedia, ti nawaya nga ensiklopedia Naragsak nga isasangbay iti Wikipedia, ti nawaya nga ensiklopedia a mabaliwan ti sinoman. Agdama daytoy nga aglaon kadagiti 15,441 nga artikulo iti Ilokano. Napili nga artikulo Ti Baybay Mediteraneo ket maysa a baybay a naikapet idiay Taaw Atlantiko ken napalikmutan babaen ti rehion ti Mediteraneo ken gangani pay a napalikmutan babaen ti daga: iti amianan babaen ti Europa ken Anatolia, iti abagatan babaen ti Amianan nga Aprika, ken iti daya babaen ti Lebante. Ti baybay ket sagpaminsan a naipanpanunotan a kas paset ti Taaw, ngem daytoy ket kankanayon a nailaslasin a kas maysa kompleto a nailasin a bagi ti danum. Ti nagan a Mediteraneo ket naala manipud ti Latin a mediterraneus, a kayatna a sawen ket \"akin-uneg a daga\" wenno \"iti tengnga ti daga\" (manipud ti medius, \"tengnga\" ken terra, \"daga\"). Daytoy ket sakupenna ti agarup a kalawa ti 2.5 a riwriw kmยฒ (965,000 sq mi), ngem ti pannakaikapetna ti Atlantiko ket 14 km (8.7 mi) laeng iti kalawa. Iti oseanograpia, daytoy ket sagpaminsan a tinawtawagan ti Baybay Euraprikano Mediteraneo wenno ti Europeano a Baybay Mediteraneo tapno mailasin daytoy manipud kadagiti sabsabali a lugar ti baybay mediteraneo. Ti Baybay a Mediteraneo ket addaan iti natimbeng a kaadalem iti 1,500 m (4,900 kadapan) ken ti kaadaleman a nairehistro a puntos ket 5,267 m (17,280 kadapan) iti Naadalem a Calypso idiay Baybay Honiko. Basaen ti napno nga artikulo โ Dadduma pay a napili nga artikulo... Pagiwanwanan Naragsak a panagdadanon ditoy Ilokano Wikipedia, kakabsat! Ipatpategmo kadi ti kina-Ilokanom? Ipasindayagmo kadi met ti kina-Saluyotmo? Mail-iliwanka kadi no mangngegmo ti bukodmo a sao aglalo no addaka iti ganggannaet a lugar? Kayatmo kadi a maitandudo ken maitampok ti tattao nga Ilokano ken ti pagsasaom? Tulongandakami man ngarud a mangpadakkel iti daytoy a Wikipedia para kadagiti Ilokano ken iti amin. Saan nga iti kaadu ti artikulo ti birbirukenmi, dagiti panid ken artikulo a nabukel, nalawag, ken makita ti napatpateg. Ala, man, ngarud, sumrekka metten, a, kabsat, ta agbibinnadangtayo a mangpadur-as iti Ilokano Wikipedia! Agdadamoka kadi? Surotem ti pakabuklan ti Ilokano Wikipedia. Masapulmo iti tulong? Sumrekka iti pagtitinnulongan tapno masungbatan amin a salsaludsodmo. Adda kadi an-annuroten ditoy? Siempre, iwanwandaka ngarud. Kasano ngay ti mangirugi iti baro a panid? Ipadigom ti kinalaingmo ditoy Ay, nagalas met! Baliwam man kadi dagiti artikulo no mabalbalin. For non-Ilokano speakers please visit the local embassy or request help here. Ammom kadi... Manipud kadagiti artikulo ditoy Ilokano Wikipedia: ... a ti Bantay Kilimanjaro (nailadawan) ket maysa a malmalmeng a bulkan ken isu ti katayagan a bantay idiay Aprika? ... a ti Manila ket isu ti kapusekan ti populasion a siudad iti lubong? ... a ti Dhaka idi tinurayan ti Mughal idi maika-17 a siglo ket ammo a kas ti Jahangir Nagar? ... a ti Baybay Mediteraneo ket nanaganan manipud ti Latin a balikas ti mediterraneus a kayatna a sawen ket \"akin-uneg a daga\" wenno \"iti tengnga ti daga\" (manipud ti medius, \"tengnga\" ken terra, \"daga\")? ... a ni Fyodor Dostoyevsky ket nagsagsagaba kadagiti banag a maipapan ti kuarta ken naglimlimos idi gapu ti pannakairuamna iti panagsugal? Dadduma pay nga ammom kadi... Dagiti kategoria Kailokuan Kultura Matematika Naipakat a Siensia Siensia Siensia Sosial Teknolohia Amin nga artikulo Amin a kategoria Daras tuldo Napili a ladawan Ti panagdaliasat ti Benus. (Dagitoy a napili a ladawan ket makita babaen ti suheto wenno babaen ti pagilian idiay Wikimedia Commons.) Dadduma pay a napili a ladawan... Kakabsat a proyekto Ibalbalayan ti Pundasion ti Wikimedia ti Wikipedia, ti maysa a di aggangganansia a gunglo a mangibalbalay pay kadagiti nadumaduma a proyekto: Commons Nawaya a pagidulinan ti midia MediaWiki Pagparang-ayan ti sopwer Meta-Wiki Koordinasion dagiti proyekto Wikibooks Libre a liblibro ken manual Wikidata Nawaya a batayan ti pannakaammo Wikinews Naurnong a damdamag Wikiquote Naurnong nga inadaw a pasasao Wikisource Biblioteka ti nawaya a linaon Wikispecies Katalogo dagiti sebbangan Wikiversity Nawaya a pagadalan Wikivoyage Nawaya a tarabay ti panagbanniaga Wiktionary Nawaya a diksionario Dadduma a pagsasao ti Wikipedia Naisurat daytoy a Wikipedia iti Ilokano, ken napartuat idi Oktubre 7, 2005. Adu pay dagiti sabali a magun-od a Wikipedia, makita dita baba dagiti Wikipedia ti Filipinas ken dagiti sumagmamano a kadakkelan. Dagiti Wikipedia ti Filipinas Bikol Central Cebuano Chavacano de Zamboanga Pangasinan Kapampangan Tagalog Winaray 1,000,000+ nga artikulo ุงูุนุฑุจูุฉ Deutsch English Espaรฑol Franรงais Italiano Nederlands ๆฅๆฌ่ช Polski Portuguรชs ะัััะบะธะน Svenska ะฃะบัะฐัะฝััะบะฐ Tiแบฟng Viแปt ไธญๆ 250,000+ nga artikulo Bahasa Indonesia Bahasa Melayu ้ฉๅ่ช / Bรขn-lรขm-gรญ ะัะปะณะฐััะบะธ Catalร ฤeลกtina Dansk Esperanto Euskara ูุงุฑุณโ ืขืืจืืช ํ๊ตญ์ด Magyar Norsk Bokmรฅl Romรขnฤ Srpski Srpskohrvatski Suomi Tรผrkรงe 50,000+ nga artikulo Asturianu Bosanski Eesti ฮฮปฮปฮทฮฝฮนฮบฮฌ Simple En",
