    "content": "Saltar ao contido Na Galipedia, a Wikipedia en galego. Dรกmosche a benvida รก Galipedia A enciclopedia libre que calquera pode editar sรกbado, 13 de decembro de 2025 Versiรณn para mรณbiles Nesta versiรณn en galego, que comezou o 8 de marzo de 2003, xa temos 228โ281 artigos. Benvida COMOs Preguntas frecuentes Comunidade Polรญticas Artigos de calidade Axuda Artigo destacado Minecraft รฉ un videoxogo de mundo aberto tipo sandbox creado orixinalmente polo deseรฑador e programador sueco Markus \"Notch\" Persson e desenvolvido e publicado posteriormente pola empresa fundada por el, Mojang. Os aspectos creativos e de construciรณn de Minecraft permรญtenlles รณs xogadores construรญr elementos a partir de cubos con diversas texturas nun mundo en tres dimensiรณns xerado por procedementos. Outras actividades do xogo inclรบen a exploraciรณn, a recolecciรณn de recursos, a confecciรณn de obxectos e o combate. Dispรณn de varios modos de xogo, incluรญndo un modo de supervivencia no que o xogador debe conseguir recursos para construรญr o mundo de xogo e manter a sรบa saรบde, un modo creativo no que os recursos son ilimitados e o xogador ten a capacidade de voar, un modo de aventuras que permite xogar niveis e mapas creados por outros xogadores e un modo espectador no que os xogadores poden voar e observar o mundo pero sen interactuar con el. A versiรณn para PC do xogo destaca pola sรบa comunidade de modding. Outros artigos destacados โข Artigos de calidade Sobre Galicia Ricardo Courtier, nado na Coruรฑa o 10 de marzo de 1865 e finado en Ourense o 10 de decembro de 1922, foi un mรบsico e compositor galego. Nado nunha familia de mรบsicos, รฉ considerado o membro mรกis salientable da terceira xeraciรณn de mรบsicos da saga Courtier. Logo de finalizar a sรบa formaciรณn instalouse na Pobra de Trives, onde foi director da banda de mรบsica. Foi precisamente nesta vila ourensรก onde desenvolveu un intenso labor fundando diversas agrupaciรณns e compoรฑendo obras que serรญan interpretadas por estas. Posteriormente trasladouse coa sรบa familia รก cidade de Ourense, onde residiu ata o seu falecemento, e onde foi director da Banda de Mรบsica Municipal. A sรบa obra salienta pola influencia da mรบsica tradicional galega, con harmonรญas sinxelas e formas tรญpicas da mรบsica popular. Ademais do seu labor como compositor, Ricardo Courtier realizou arranxos para as distintas agrupaciรณns que liderou. Outros artigos destacados sobre Galicia โข O mes de decembro na cultura popular galega Tal dรญa coma hoxe no ano... 1545, comeza o Concilio de Trento en Trento, Italia. 1937, durante a Segunda Guerra Chinesa-Xaponesa remata a Batalla de Nanjing coa vitoria das tropas xaponesas, dando comezo o Masacre de Nanjing. 1959, Makarios III, arcebispo da Igrexa Ortodoxa Chipriota, convรฉrtese no primeiro presidente de Chipre. 1981, o xeneral Wojciech Jaruzelski declara a lei marcial en Polonia para impedir que Solidaridade desmantele o sistema socialista. 1996, Kofi Annan รฉ elixido Secretario Xeral das Naciรณns Unidas. 2003, Saddam Hussein (na imaxe), ex-presidente de Iraq, รฉ capturado preto de Tikrit polas tropas estadounidenses. Hoxe รฉ o Dรญa da Repรบblica en Malta (1974). Mรกis efemรฉrides do dรญa de hoxe โข Outras Efemรฉrides destacadas Imaxe do dรญa Lago Kinney e monte Whitehorn. Vexa o artigo Parque provincial Monte Robson Outras imaxes destacadas โข Imaxes destacadas en Commons Presentaciรณn A Wikipedia รฉ unha enciclopedia universal en liรฑa multilingรผe, colaborativa e gratuรญta. O propรณsito da Wikipedia รฉ fornecer un contido libre, obxectivo e verificable que todas as persoas poidan editar e mellorar. O proxecto estรก baseado en cinco principios bรกsicos, todo o contido estรก dispoรฑible baixo a licenza Creative Commons BY-SA e pode ser copiado e reutilizado baixo esta mesma licenza. Benvida โข รndice da Axuda Participaciรณn Podes consultar a Axuda e a Guรญa para obter mรกis informaciรณn de como participar, nas que atoparรกs informaciรณn de como comezar a colaborar, editar artigos e usar imaxes libres. En caso de dรบbidas sรญntete libre de preguntar. COMOs โข Preguntas mรกis frecuentes Comunidade De acordo coas nosas estatรญsticas, temos un total de 161โ812 contas de usuario rexistradas na Galipedia, e entre elas 535 estiveron activas durante o รบltimo mes. Todas as persoas que editan a Galipedia son voluntarias, integrando unha comunidade colaborativa e coordinando os esforzos por medio de proxectos temรกticos e diversos espazos de conversa. Portal da comunidade โข Polรญticas e normas Meta-Wiki Meta-Wiki Coordinaciรณn Wikimedia Commons Commons Multimedia Wiktionary Galizionario Dicionario Wikibooks Galilibros Libros Wikisource Galifontes Documentos Wikiquote Galicitas Citas Wikispecies Wikispecies Especies Wikinews Wikinews Novas Wikiversity Wikiversity Aprendizaxe Wikivoyage Wikivoyage Viaxes Wikidata Wikidata Datos MediaWiki MediaWiki Desenvolvemento Obtido de ยซhttps://gl.wikipedia.org/w/index.php?title\u003dPortada\u0026oldid\u003d7053480ยป Categorรญa: รndice Categorรญa agochada: Wikipedia:Artigos con extractos 40 linguas Aragonรฉs ุงูุนุฑุจูุฉ Asturianu C",
