    "content": "Jump to content From Wikipedia, the free encyclopedia Assault rifle Trichy assault rifle Trichy production model Type Assault rifle Place of origin India Service history In service 2017โpresent Used by India Wars NaxaliteโMaoist insurgency Production history Designer Ordnance Factory Tiruchirappalli, Advanced Weapons and Equipment India Designed 2011-2015 Unit cost Ordnance Factory Tiruchirappalli Produced 2017โpresent Variants See Variants Specifications Mass 3.4 kg (7.5 lb) (TAR) 3.17 kg (7.0 lb) (TriCa) Length 900 mm (35 in) (Trichy Folding Stock Top) Barrel length 650 mm (25.6 in) (Trichy Folding Stock Top) Cartridge 7.62ร39mm Caliber 7.62 Action Gas-operated reloading Rate of fire 600 rounds/min (Full automatic) Muzzle velocity 710โ715 m/s (2,330โ2,350 ft/s) Effective firing range 300โ350 m (330โ380 yd) (TAR) 140 m (150 yd) (TriCa) Maximum firing range 150โ175 m (164โ191 yd) (TriCa) Feed system 30-round detachable box magazine Sights Scopes with picatinny rail (If customised from order) References [1][2] The Trichy assault rifle (TAR), sometimes known as the Tiruchi assault rifle,[3] is an Indian-made assault rifle chambered for the 7.62x39 mm round. The TAR is based on the AR-M1, produced by Bulgarian manufacturer Arsenal AD. Developed between 2011 and 2015, Ordnance Factory Tiruchirappalli (OFT) began manufacturing TARs in 2017. The TAR was developed to reduce dependence on imported AR-M1s under the Atmanirbhar Bharat self-reliance policy. The TAR has been adopted by most Indian law enforcement agencies. History [edit] Background [edit] Prior to the TAR\u0027s introduction, India largely used foreign-made AK-style rifles. Around 500,000 M1s were reportedly imported by India from Bulgaria in 2021 for use by the Central Armed Police Forces (CAPF) and Indian police forces.[4] As of May 2025, India is the second-largest arms importer after Ukraine, accounting for 8.3% of the arms trade, according to research data from the Stockholm International Peace Research Institute.[5] To reduce dependence on importing small arms from other countries, part of the Atmanirbhar Bharat policy called for self-sufficiency to manufacture firearms in India.[6] OFT announced the manufacture of an indigenous AK-based assault rifle in 2011.[7][8] The AR was named Trichy after OFT to recognise the factory\u0027s contribution in developing and manufacturing the rifle.[9] Some TARs were made in 2012 to be tested.[10] These early TARs were tested by the Border Security Force (BSF), the Central Reserve Police Force (CRPF), the Indo-Tibetan Border Police and the Sashastra Seema Bal.[10] Development started in 2015[11] with a production line established in 2017.[12][13] That March, 200 TARs were acquired by the Chhattisgarh Police[14] as part of the 216th Ordnance Factories Day celebration.[15] Concerns were raised at the time, prior to manufacture, that OFT was experiencing manpower decline, leading to a decline of employees at the company.[16] The All India Defence Employees Federation, the Indian National Defence Workers\u0027 Federation, and the Bharatiya Pratiraksha Mazdoor Sangh stated their opposition to importing small arms with the unions hoping that more orders for the TAR would be approved, retaining employees at OFT.[16] A CISF officer practices with the TAR at a shooting range. Adoption [edit] In November 2017, the CRPF conducted field tests to determine the suitability of the TAR with 15,000 rounds fired[12] at the CRPF Academy in Kadarpur, Haryana with no reports of the rifle jamming.[17] Other tests conducted included the TAR being fired from mud, rain and saltwater and from being dropped to test reliability and accuracy.[18] 100 TARs were ordered afterwards.[18] In February 2018, further tests were conducted by the CRPF at Jagdalpur, Raipur, Guwahati and Srinagar with an order of 6,167 TARs placed afterwards.[12] At the time, the CRPF tested the Trichy with the Ghatak, the Joint Venture Protective Carbine and the INSAS1C.[19] In March 2020, the CRPF acquired the first 500 out of 6,167 TARs sold to them.[11] In January 2019, the TAR was delivered to the BSF, with its Additional Director General Nasir Kamal receiving the first rifle from the Ordnance Factory Board\u0027s Director General Saurabh Kumar.[3] It was reported in the same month that the Jharkhand Police would acquire TARs for anti-Naxalite operations.[20] The TAR was displayed for the first time at the Pragati Maidan in New Delhi for the 5th International Police Expo and the 4th India Homeland Security Expo.[21] In February 2020, the TAR was on public display at the Defence Expo at Lucknow, Uttar Pradesh.[22] It was reported at the time that the TAR was offered to the Indian Army.[22] OFT reported in March 2021 that around 11,500 TARs were supplied for a total of Rs 1.60 billion during fiscal year 2020โ21.[23] In January 2021, the TriCa (Trichy Carbine) Carbine was unveiled.[2] Tests were conducted where 2,000 rounds were fired with no stoppages.[4] That August, OFT announced t",
