    "title": "Wikipedia, ang malayang ensiklopedya",
    "content": "Pumunta sa nilalaman Mula sa Wikipedia, ang malayang ensiklopedya Wikipedia, ang malayang ensiklopedyang maaaring baguhin ninuman. Bersiyong mobile Magtanong sa pamayanan Paano magsimula? Tulong sa nilalaman Mga paksa Mabilisang indeks For non-Tagalog speakers Napiling artikulo Mapa ng Maynila na pinapakita ang mga lugar na interesadong puntahan. Ang Lungsod ng Maynila ([luลหsod nษล majหnilaส], Espanyรณl: Ciudad de Manila, Ingles: City of Manila), kilala bilang Maynila, ay ang punong-lungsod at ang pangalawang pinakamataong lungsod ng Pilipinas. Mataas ang pagkaurbanisado, ito ang lungsod na may pinakamakapal na dami ng tao sa buong mundo noong 2019. Tinuturing ang Maynila na isang pandaidigang lungsod at grinado bilang isang LungsodโAlpha (o Alpha โ City) ng Globalization and World Cities Research Network (GaWC). Ito ang unang lungsod sa bansa na naka-karta (o may sariling saligang-batas), na itinalaga ng Batas ng Komisyon ng Pilipinas Blg. 183 ng Hulyo 31, 1901. Naging awtonomo ito nang napasa ang Batas Republika Blg. 409, \"Ang Binagong Karta ng Lungsod ng Maynila\", noong Hunyo 18, 1949. Tinuturing ang Maynila bilang bahagi ng orihinal na pangkat ng mga pandaigdigang lungsod dahil lumawig ang network nitong pang-komersyo sa Karagatang Pasipiko at kumonekta sa Asya ang Kastilang mga Amerika sa pamamagitan ng kalakalang Galeon; nang nagawa ito, tinatakan nito ang unang pagkakataon sa kasaysayan ng mundo na naitatag ang isang hindi naabalang kadena ng ruta ng kalakalan na pumapalibot sa planeta. Ito ang isa sa mga pinakamatao at pinakamabilis na lumagong lungsod sa Timog-silangang Asya na may kabuuang populasyon na sa na kabahayan ayon noong ?. Sumasakop ng 42.88 na kuwadrado kilometro, ang lungsod na ito ay nasa baybayin ng Look ng Maynila na nasa kanlurang bahagi ng Pambansang Punong Rehiyon na nasa kanlurang bahagi ng Luzon. Napalilibutan ang Maynila ng mga lungsod ng Navotas at Caloocan sa hilaga, Lungsod Quezon sa hilagang-silangan, San Juan at Mandaluyong sa silangan, Makati sa timog-silangan at Pasay sa timog. Ang Maynila ay may 900 na kilometro ang layo mula sa Hong Kong, 2,400 na kilometro ang layo mula sa Singapore at mahigit 2,100 na kilometro ang layo sa hilagang-silangan mula sa Kuala Lumpur. Nahahati ang Maynila sa dalawa ng ilog Pasig. Sa depositong alubyal ng ilog Pasig at look ng Maynila nakapwesto ang nakakaraming sinasakupan ng lungsod na gawa mula sa tubig. Mga napiling artikulo Pamantayan Magnomina Alam ba ninyo ... ...na ikalawang pinakamalaking sistema ng ilog sa Pilipinas ang Ilog Mindanao na tinatawag ding Rio Grande de Mindanao? ...na isinama ng magasin na Time noong 2011 ang mga tao-tauhang sundalo (nakalarawan) sa kanilang talaan ng 100 pinakasikat na laruan sa lahat ng panahon? ...na ang mga sinaunang megalitong nuraga o nuraghe ang simbolo ng Kabihasnang Nurahiko ng Cerdeรฑa? Mga nagdaang napili Mga pinakabagong artikulo Magsimula ng bagong artikulo Sa araw na ito (Disyembre 9) Disyembre 9 Barbados 1966 โ Sumapi ang Barbados sa Mga Nagkakaisang Bansa. Mga huling araw: Disyembre 8 โ Disyembre 7 โ Disyembre 6 Sinupan Sa e-liham Talaan ng mga makasaysayang anibersaryo Napiling larawan Si Sally Kristen Ride (Mayo 26, 1951 โ Hulyo 23, 2012) ay isang Amerikanong astronauta at pisiko. Ipinanganak sa Los Angeles, sumali siya sa NASA noong 1978, at noong 1983 naging unang babaeng Amerikano at pangatlong babae na lumipad sa kalawakan, pagkatapos ng mga kosmonauta na sina Valentina Tereshkova noong 1963 at Svetlana Savitskaya noong 1982. Siya ang pinakabatang Amerikanong astronauta na lumipad sa kalawakan, na nagawa ito sa edad na 32. May-akda ng larawan: NASA Marami pang napiling larawan Mga dekalidad na larawan sa Wikimedia Commons Patungkol Ang Wikipedia ay isang proyektong online na ensiklopedya na panlahat, nakasulat sa maraming wika, at pinagtutulungan ang paggawa ng mga artikulo sa prinsipyong wiki. Naglalayon ang proyektong ito na mag-alok ng mga nilalaman na malayang muling magagamit, walang pinapanigan, at napapatunayan, na maaring baguhin at mapabuti ninuman. Nakikilala ang Wikipedia sa pamamagitan ng mga naitatag na prinsipyo. Nakalisensiya ang nilalaman nito sa ilalim ng Creative Commons BY-SA. Maari itong kopyahin at muling gamitin sa ilalim ng parehong lisensiya, na sumasailalim sa paggalang sa mga kondisyon. Ibinbigay ng Wikipedia ang mga nilalaman nito ng walang bayad, walang patalastas, at hindi nagsasamantala sa paggamit ng personal na datos ng mga gumagamit nito. Mga boluntaryo ang nag-aambag o patnugot ng mga artikulo sa Wikipedia. Nakikipag-ugnayan sila sa isa\u0027t isa tungkol sa kanilang mga pagsisikap sa loob ng pamayanang nagtutulungan at walang pinuno. Sa ngayon, mayroon ang Wikipediang Tagalog na: 48,811 artikulo 337 aktibong tagapag-ambag Paano makapag-ambag? Maaring maglathala ng online na nilalaman ang kahit sino basta\u0027t sundin nila ang mga pangunahing alintuntuning itinakda ng Pundasyong Wikimedia at ng pamayanan; halimbawa, pagpapatunay ng nilalaman, notabilidad,",
