    "content": "Jump to content Daga Wikipedia, Insakulofidiya ta kyauta. Barka da zuwa Wikipedia ta Hausa Insakulofidiya ta kyauta wacce kowa zai iya gyarawa. Mukaloli 73,421 a cikin Harshen Hausa Adabi Tarihin mutane Addini Tarihi Lissafi Kimiyya Zamantakewa Fasaha Dukkannin ฦofofi Muฦalar mu a yau Mamdani a wajen gangamin adawa da wariyar launin fata a Bryant Park, Oktoba 27, 2024 Zohran Kwame Mamdani (an haife shi a ranar 18 ga Oktoba, 1991) ษan siyasa ne ษan asalin Uganda da Indiya wanda yake zaune a Amurka. Shi ne ษan majalisar jiha a New York mai wakiltar District 36, wanda ya haษa yankuna irin su Astoria da Long Island City a birnin New York. Mamdani ษan jamโiyyar Democrat ne, kuma yana daga cikin mambobin Democratic Socialists of America. A shekarar 2025, ya tsaya takara don zama Magajin Garin Birnin New York. A rana irin ta yau A wasu ranaku Usman dan Fodio Hijirar Annabi Ranan Salla Yau 4 ga Oktoba na 2025 Ga wasu muhimman abubuwa na tarihi da suka faru a wannan rana. 1582: An fara aiwatar da Kalandar Gregorian a kasashe da dama na Turai. 1824: Kyaftin Lord Byron ya isa ฦasar Girka domin taimaka wa \u0027yan gwagwarmaya a yaฦin neman \u0027yancin kai. 1883: An kafa ฦungiyar Orient Express wadda ta fara jigilar jirgin kasa daga Paris zuwa Istanbul. 1957: An kaddamar da Sputnik 1 ta Tarayyar Soviet, tauraron dan adam na farko a duniya. 1966: Lesotho ta samu \u0027yancin kai daga Birtaniya. 1985: Free Software Foundation (FSF) ta fara aiki karkashin jagorancin Richard Stallman. 1993: Rundunar Amurka ta yi faduwar jirgi a Mogadishu, Somaliya (wanda aka fi sani da Black Hawk Down). 2004: Taโaddanci ya faru a Samarra, Iraki, wanda ya jawo mutuwar mutane da dama. 2011: Rundunar NATO ta kammala yaฦin cikin gida a Libya bayan kifar da gwamnatin Muammar Gaddafi. Ko kun san...? Ko ka san bangarorin nan Shin ko ka san Addinai Shin ko ka san Al\u0027adu Shin ko ka san Ilimi Birnin Benin ta kasance cibiyar masarautar Benin wadda ta yi fice da zane-zanen tagulla? Kogin Neja yana zagaye siffar baka kafin ya zubo a Tekun Guinea? Wakokin bori na da tasiri sosai a tarihin kiษa da al\u0027adun Hausawa? Lagos ita ce birni mafi girma a Najeriya da kuma daya daga cikin mafi cunkoso a duniya? A Chad, tafkin Chadi yana raguwa da sauri sakamakon dumamar yanayi? Arewacin Najeriya na da wuraren tarihi da dama irin su Birnin Zaria da Birnin Kano? Gidan Rumfa a Kano an gina shi tun karni na 15 kuma yana daya daga cikin tsofaffin fadodi a Afirka? Addinin Islama ya fara shigowa Najeriya ne ta hanyar kasuwanci a Arewaci tun karni na 11? Gibraaltar wuri ne mai matuฦar muhimmanci tsakanin Turai da Afirka saboda matsayinsa na hanya? Mali da Songhai sun taba zama daular musulunci masu karfi a yammacin Afirka? Kanun labarai Shafukan da ake bukatar a ฦara inganta su Kofi Annan Abubakar Adam Ibrahim Sam Adekugbe Thomas Sankara Daurama Kabara Patrice Lumumba Maguzawa Gaskiya Ta Fi Kwabo Barikanchi Pidgin Ajami Baiko Nigerian braille Hausa Bakwai Barazanar Amurka da Rikicin Siyasa a Najeriya: Barazanar da tsohon Shugaban Amurka, Donald Trump, ya yi na cewa zai iya kai hari Najeriya don \"kare Kiristoci\" ta jawo cece-kuce mai zafi a tsakanin \u0027yan siyasa da ฦungiyoyin addinai a Najeriya. Gwamnatin Tarayya da Hafsun Tsaro sun yi martani, tare da nuna adawa ga hakan. Nadin Mukamai da Karษo Bashin Kuษi a Najeriya: Shugaban Bola Ahmed Tinubu ya ci gaba da yin nadin sabbin Manyan Sakatarorin Gwamnati guda biyar, kuma ya aika buฦatar karษo rancen sama da Naira tiriliyan 1 ga Majalisar Dokoki don gudanar da wasu ayyuka. Yajin Aikin Likitoci da Tsadar Rayuwa a Najeriya: Yajin aikin da ฦungiyar Likitocin mazauna (NARD) suka shiga ya haifar da ฦarin wahala da kuma tsadar jinya a asibitocin kuษi ga al\u0027ummar ฦasar. Bugu da ฦari, farashin kayan abinci ya ci gaba da zama babbar matsala. Rikicin Sudan da Tattaunawar Zaman Lafiya: Rikicin da ke gudana a Sudan tsakanin Sojojin Gwamnati da Rapid Support Forces (RSF) ya ci gaba, inda aka samu labaran luguden wuta kusa da El-Fasher. Ana kuma shirye-shiryen ganawa tsakanin ฦungiyoyin farar hula na Sudan a Addis Ababa a ฦarฦashin kulawar Tarayyar Afirka don tattauna makomar ฦasar. Buษe Babban Gidan Tarihi a Masar: An buษe Babban Gidan Tarihi na Masar (GEM), wanda aka shafe shekaru 20 ana ginawa, a hukumance a birnin Alkahira. Shugaban Masar, Abdul Fattah Al-Sisi, ya halarci buษewar. Siyasar Chadi da Djibouti: Gamayyar jam\u0027iyyun adawa a Chadi sun sanar da ficewa daga lamuran siyasar ฦasar. Haka kuma, Majalisar Dokokin Djibouti ta kawo ฦarshen dokar da ta shafi ฦayade shekarun Shugabancin ฦasa. Taron Kasuwanci da Haษin Gwiwar Sin da Afirka: Kamfanonin Afirka ta Kudu sun nuna sha\u0027awar gano damammakin kasuwanci a Baje Kolin Abubuwan da Ake shigowa da su na ฦasar Sin (CIIE). Sin tana kuma ฦoฦarin ฦarfafa haษin gwiwar fasahar gwaje-gwaje a cibiyar CDC ta Afirka. Barazanar Ukraine da Rasha: An samu rahotanni cewa shugaban Ukraine ya gaza samun manyan makamai masu linzami daga Amurka, waษanda zasu iya kai hari a Rasha. Zaka iya duba babban shafin English Wikip",
