    "content": "Jump to content From Wikipedia, the free encyclopedia State in Australia Queensland State Flag Coat of arms Nickname(s): The Sunshine State Motto: Audax at Fidelis (Latin) (English: Bold but Faithful) QLD NSW ACT WA NT SA VIC TAS Location of Queensland in Australia Country Australia First British settlement September 1824 (1824-09) (Moreton Bay) Separation from New South Wales 6 June 1859 (1859-06-06) (as Colony of Queensland) Federation 1 January 1901 (1901-01-01) Named for Queen Victoria Capital and largest city Brisbane 27ยฐ28โฒ08โณS 153ยฐ1โฒ25โณE๏ปฟ / ๏ปฟ27.46889ยฐS 153.02361ยฐE๏ปฟ / -27.46889; 153.02361 Administration 77 local government areas Demonym(s) Queenslander Government Parliamentary constitutional monarchy โข Monarch Charles III โข Governor Jeannette Young โข Premier David Crisafulli (LNP) Legislature Parliament of Queensland Judiciary Supreme Court of Queensland and lower courts Parliament of the Commonwealth โข Senate 12 senators (of 76) โข House of Representatives 30 seats (of 150) Area โข Land 1,723,030[1] km2 (665,270 sq mi) Highest elevation (Mount Bartle Frere) 1,622 m (5,322 ft) Population โข Estimate 5,647,468 (March 2025)[2] (3rd) GSP 2021 estimate โข Total AU$503.4 billion[3] (3rd) โข Per capita AU$73,030 (5th) HDI (2023) 0.947[4] very high ยท 5th Time zone UTC+10:00 (AEST) Postal abbreviation QLD ISO 3166 code AUโQLD Symbols Bird Brolga (Grus rubicunda) Fish Barrier Reef Anemone Fish (Amphiprion akindynos) Flower Cooktown orchid (Dendrobium phalaenopsis)[5] Mammal Koala (Phascolarctos cinereus) Colour(s) Maroon (official and sport)[6] Blue (government logo and branding, since 2025)[7] Fossil Muttaburrasaurus langdoni Mineral Sapphire Website qld.gov.au Queensland (locally /หkwiหnzlรฆnd/ KWEENZ-land,[note 1] commonly abbreviated as QLD) is a state in northeastern Australia, the second-largest and third-most populous state in Australia. It is bordered by the Northern Territory, South Australia and New South Wales to the west, south-west and south, respectively. To the east, Queensland is bordered by the Coral Sea and the Pacific Ocean; to the state\u0027s north is the Torres Strait, separating the Australian mainland from Papua New Guinea, and the Gulf of Carpentaria to the north-west. With an area of 1,723,030 square kilometres (665,270 sq mi), Queensland is the world\u0027s sixth-largest subdivision of any country on earth; it is larger than all but 16 countries. Due to its size, Queensland\u0027s geographical features and climates are diverse, and include tropical rainforests, rivers, coral reefs, mountain ranges and white sandy beaches in its tropical and sub-tropical coastal regions, as well as deserts and savanna in the semi-arid and desert climatic regions of its interior. Queensland has a population of over 5.5 million,[9] concentrated in South East Queensland, where nearly three in four reside. The capital and largest city in the state is Brisbane, Australia\u0027s third-largest city and comprising fully half of the state\u0027s population. Ten of Australia\u0027s thirty largest cities are located in Queensland, the largest outside Brisbane being the Gold Coast, the Sunshine Coast, Townsville, Cairns, Ipswich, and Toowoomba. 24.2% of the state\u0027s population were born overseas.[10] The state has the highest inter-state net migration in Australia.[11] Queensland was first inhabited by Aboriginal Australians, with the Torres Strait Islands inhabited by Torres Strait Islanders.[12] Dutch navigator Willem Janszoon, the first European to land in Australia, explored the west coast of the Cape York Peninsula in 1606. In 1770, James Cook claimed the east coast of Australia for the Kingdom of Great Britain. In 1788, Arthur Phillip founded the colony of New South Wales, which included all of what is now Queensland. Queensland was explored in subsequent decades, and the Moreton Bay Penal Settlement was established at Brisbane in 1824 by John Oxley. During the Australian frontier wars of the 19th century, colonists killed tens of thousands of Aboriginal people in Queensland while consolidating their control over the territory. On 6 June 1859 (now commemorated as Queensland Day), Queen Victoria signed the letters patent to establish the colony of Queensland, separating it from New South Wales and thereby establishing Queensland as a self-governing Crown colony with responsible government. A large part of colonial Queensland\u0027s economy relied on blackbirded South Sea Islander slavery.[citation needed] Queensland was among the six colonies which became the founding states of Australia with Federation on 1 January 1901. Since the Bjelke-Petersen era of the late 20th century, Queensland has received a high level of internal migration from the other states and territories of Australia and remains a popular destination for interstate migration. Queensland has the third-largest economy among Australian states, with strengths in mining, agriculture, transportation, international education, insurance, and banking. Nicknamed the Sunshine State for its tr",
