    "title": "Shinto Directive - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Post-WWII order issued by Allied Occupation Authorities This article needs additional citations for verification. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Find sources: \"Shinto Directive\" โ news ยท newspapers ยท books ยท scholar ยท JSTOR (March 2014) (Learn how and when to remove this message) Shinto Declaration Supreme Commander of the Allied Powers Long title Abolition of Governmental Sponsorship, Support, Perpetuation, Control, and Dissemination of State Shinto Enacted by Supreme Commander of the Allied Powers Enacted December 15, 1945 The Shinto Directive was an order issued in 1945[1] to the Japanese government by Occupation authorities to abolish state support for the Shinto religion. This unofficial \"State Shinto\" was thought by Allies to have been a major contributor to Japan\u0027s nationalistic and militant culture that led to World War II. The purpose of the directive was ostensibly based in ideas of freedom of religion and separation of church and state. History [edit] After the Second World War, it was generally understood by Allied students of Japanese culture and religion that Shinto in the form it took leading up to and during the war was social propaganda and was used as a tool of ultra-nationalism and a disguise for militarism.[citation needed] However, even though this support of Shinto was defined as non-religious propaganda[by whom?], in the Allied schools it was being taught as religious in nature. Thus, it was US policy regarding post-surrender Japan to abolish \"State Shinto,\" which was not and never had been a formal Imperial policy.[citation needed] The directive, SCAPIN 448, was drafted by the US military\u0027s expert on Japanese culture and religion, Lieutenant William K. Bunce, U.S.N.R.[2] and was issued on December 15, 1945, with the full title of \"Abolition of Governmental Sponsorship, Support, Perpetuation, Control, and Dissemination of State Shinto (Kokka Shinto, Jinja Shinto)\".[3] There were two translations given for the term \"State Shinto\": the first (\"Kokka Shinto\") was a neologism, and the second (\"Jinja Shinto\") referred to Shinto shrines, which up until 1945 had been secular wards of the state.[citation needed][4] According to the directive, State Shinto was to be stripped of public support and of its \"ultra-nationalistic and militaristic\" trappings. With the severing of its traditional state patronage, the Shinto establishment required privatization, and to that end any Shinto entity that had been dependent on public funding but not actually part of the secular administrative structure was to be assimilated either into what the directive calls \"Sect Shinto\" with no special privileges above the other popular faiths, or to be reformed, with conditions stipulating complete and permanent loss of government support, as \"Shrine Shinto,\" which was to be supported by voluntary private donation only.[non-primary source needed] No public funds whatsoever could therefore be used to support Shinto shrines or priests in any manner, nor any other entities that were at all associated with the Shinto religion. Public officials whose duties were in any way directly connected to Shinto religion were immediately to be terminated from office and their positions extinguished. Under the directive, Japan\u0027s Emperor could no longer report on public matters to his ancestors during official visits to the shrines. Instead, he was permitted to worship only non-officially and as a private individual, as all government officials were permitted to do. Any educational material considered to convey \"Shinto doctrine\" was to be categorically censored out of school textbooks, along with any content that at all suggested any positive effects of or justification for any of Japan\u0027s military actions in past wars. Public officials alike were forbidden any mention of anything that could be construed as being in any way religious, let alone Shinto, while performing duties in their official capacities. This was meant to stop the propagation of supposed \"militaristic and ultra-nationalistic ideology\" in particular, which was especially proscribed if conveyed in connection with Shinto or any other creed. These three alleged doctrines were specifically banned: (1) that the Emperor is superior to other rulers because he is descended from the sun goddess Amaterasu; (2) that the Japanese people are inherently superior to other peoples because of their special ancestry or heritage, or (3) that the Japanese islands are spiritually superior to other lands, because they are specially blessed by the Amaterasu. As a result of the directive, a stream of instructions from the government was issued covering a wide range of prohibitions concerning Japanese culture and rites.[citation needed] Pupils at state schools and children of pre-school age were prohibited from being taken on field trips to religious ",
