    "content": "Jump to content From Wikipedia, the free encyclopedia American doctor (1900โ1970) Jessie Wright M.D. Born (1900-09-05)September 5, 1900 Eccleshall, England[citation needed] Died September 6, 1970(1970-09-06) (aged 70) Royal Oak, Maryland, US Education Harvard Medical School University of Pittsburgh Medical career Notable works Rocking bed Jessie Wright (September 5, 1900 โ September 6, 1970) was an English-born medical doctor whose research led to the rocking bed being used as a popular treatment for polio. Early life and education Jessie Wright was born on September 5, 1900, in England. Her father was the headmaster of a parochial school in Eccleshall. At the age of six, her family emigrated to Pittsburgh. Her medical training began at the D. T. Watson Home for Crippled Children in 1920. She attended summer seminars at Harvard Medical School in 1922 and 1924. She became a license physical therapist in 1927, and earned a Bachelor of Science from the University of Pittsburgh in 1932. She earned her medical degree from the University of Pittsburgh School of Medicine in 1934.[1] In 1935, after completing an internship at Allegheny General Hospital, she received her license to practice medicine.[2] Career She was appointed the director of physical medicine at The Children\u0027s Hospital, the D. T. Watson Home, and the Pittsburgh Municipal Hospital in 1935, and the Western State Psychiatric Hospital in 1945.[2] From 1942 to 1956, Wright served as a consultant to the Pittsburgh Department of Health. She also was a consultant to the surgeon general of the Air Force from 1950 to 1953.[2] She was an instructor at the Pittsburgh School of Medicine, and was named an associate professor in 1951.[3] In 1952, she began collaborating with Jonas Salk on the polio vaccine at the Watson home.[1] In 1962, she was named the president of the American Association for Cerebral Palsy and Developmental Medicine.[2] Rocking bed Main article: Rocking bed In 1944, Wright began experimenting with the \"Sanders bed\", previously used to treat vascular disease, as a treatment for polio.[2][4] Charlotte Baron, a public health nurse, offered to design the bed.[5][6] By September 1946, a finished product, the Respir-aid Rocking Bed, had been completed and began trials.[5][7] Wright published her findings in July 1947.[5] By 1951, over 200 rocking beds were in hospitals,[8] and by 1964, the American Journal of Nursing reported that of some 1,612 people experiencing some degree of paralysis from polio in the United States, 334 were using iron lungs and 677 were using rocking beds.[9] In March and April 1956, Wright worked in Argentina to distribute medical equipment and develop plans to fight polio in the country. For her contributions towards the elimination of polio in the country, she received an award from the Argentine government in 1957.[3][10] Later life Wright was an Elder at the Bellefield Presbyterian Church.[11] She retired in 1966, and died on September 6, 1970, of a heart malady.[3][11] Further reading Wright, Jessie (1947). \"The Respir-Aid Rocking Bed in Poliomyelitis\". The American Journal of Nursing. 47 (7): 454โ455. doi:10.2307/3456960. ISSN 0002-936X. JSTOR 3456960. PMID 20254536. References ^ a b Alberts, Robert C. (1986). Pitt : the story of the University of Pittsburgh, 1787-1987. Pittsburgh: University of Pittsburgh Press. p. 215. ISBN 978-0-8229-1150-0. Retrieved October 27, 2025. ^ a b c d e Alexander, Michael; Turk, Margaret A.; Ayyangar, Rita (September 1, 2013). \"Dr. Jessie Wright: Breaking New Ground in Pediatric Physical Medicine and Rehabilitation\". PM\u0026R. 5 (9): 739โ746. doi:10.1016/j.pmrj.2013.07.006. hdl:2027.42/146886. ISSN 1934-1482. PMID 23933326. ^ a b c \"Dr. Jessie Wright Is Dead at 70; A Leader in Therapy for Polio\". The New York Times. September 8, 1970. p. 41. Archived from the original on February 17, 2022. Retrieved October 26, 2025. ^ Dail, C. W.; Austin, E.; Huddleston, O. L.; Bower, A. G. (July 1951). \"Use of the rocking bed to augment ventilation in patients with poliomyelitis\". California Medicine. 75 (1): 15โ25. ISSN 0008-1264. PMC 1520937. PMID 14848717. ^ a b c Wright, Jessie (1947). \"The Respir-Aid Rocking Bed in Poliomyelitis\". The American Journal of Nursing. 47 (7): 454โ455. doi:10.2307/3456960. ISSN 0002-936X. JSTOR 3456960. PMID 20254536. ^ \"Oscillating Bed Receives Praise\". The Blade. August 28, 1946. p. 17 โ via Newspapers.com. ^ \"For Polio Patients; A \u0027Rocking Bed\u0027 Replaces \u0027Iron Lung\u0027 to Help Breathing\". New York Times. July 29, 1951. Archived from the original on April 4, 2023. Retrieved October 25, 2025. ^ \"Rockabye Time For Jim Kreischer All Day Now In Polio Rocking Bed\". The Daily Sentinel-Tribune. July 31, 1951. p. 1. Retrieved October 27, 2025 โ via Newspapers.com. ^ Jeffris, Jane (1964). \"The Best Healing Device\". The American Journal of Nursing. 64 (9): 74โ77. doi:10.2307/3419419. ISSN 0002-936X. JSTOR 3419419. ^ \"Argentina Honors Dr. Jessie Wright\". The Pittsburgh Press. October 2",
