    "content": "Ir al contenido De Wikipedia, la enciclopedia libre Bienvenidos a Wikipedia, la enciclopedia de contenido libre que todos pueden editar. Buscar en 2 080 490 artรญculos 2 080 490 artรญculos en espaรฑol. Cafรฉ ยฟCรณmo colaborar? Primeros pasos Ayuda Contacto Artรญculo destacado Coldplay Actuaciรณn en el Estadio de Wembley en 2025. Coldplay es una banda britรกnica de rock formada en Londres en 1997. Estรก compuesta por el vocalista y pianista Chris Martin, el guitarrista Jonny Buckland, el bajista Guy Berryman y el baterista Will Champion, ademรกs de Phil Harvey como su mรกnager. Sus integrantes se conocieron en el University College de Londres. Firmaron con Parlophone en 1999 y lanzaron su primer รกlbum, Parachutes (2000), que incluyรณ el sencillo ยซYellowยป, con el que alcanzaron la fama. Su siguiente trabajo, A Rush of Blood to the Head (2002), logrรณ tambiรฉn una gran acogida. X\u0026Y (2005) cerrรณ lo que la banda consideraba una trilogรญa, y su sucesor, Viva la Vida or Death and All His Friends (2008), ganรณ el Grammy al mejor รกlbum de rock. Ademรกs, ยซViva la vidaยป fue la primera canciรณn de un grupo britรกnico en alcanzar de manera simultรกnea el nรบmero uno en Estados Unidos y el Reino Unido en el siglo XXI. Coldplay ampliรณ su repertorio con los discos Mylo Xyloto (2011), Ghost Stories (2014), A Head Full of Dreams (2015), Everyday Life (2019), Music of the Spheres (2021) y Moon Music (2024), en los que incorporaron influencias de la mรบsica electrรณnica, el R\u0026B, el ambient, la mรบsica disco, el funk, el gรณspel, el blues y el rock progresivo. Con mรกs de 160 millones de รกlbumes vendidos en todo el mundo, Coldplay figura entre los artistas mรกs exitosos de la historia. Fue la primera banda en alcanzar 90 millones de oyentes mensuales en Spotify y la cadena Fuse los incluyรณ entre los mรบsicos mรกs premiados, al mantener el rรฉcord de mayor nรบmero de premios Brit obtenidos por un grupo. En el Reino Unido, cuenta con tres de los cincuenta รกlbumes mรกs vendidos, la mayor cantidad de discos que alcanzaron el primer puesto en la lista UK Albums Chart sin descender de las diez primeras posiciones y el reconocimiento como el conjunto mรกs reproducido del siglo XXI en los medios britรกnicos. Dos de sus actuaciones en directo figuran entre las mรกs taquilleras y concurridas de todos los tiempos. La Industria Fonogrรกfica Britรกnica los describiรณ como una de las bandas ยซmรกs influyentes y pionerasยป del mundo, mientras que el Salรณn de la Fama del Rock and Roll incluyรณ A Rush of Blood to the Head en su lista de los 200 discos definitivos y a ยซYellowยป en la exhibiciรณn Songs That Shaped Rock and Roll. Ademรกs de su carrera musical, el grupo ha destacado por su labor filantrรณpica, polรญtica y activista. Sin embargo, pese a sus indiscutibles รฉxitos, ciertos sectores de la crรญtica han puesto en entredicho su legado como icono cultural. Leer Todos los artรญculos destacados Candidatos Anteriores: Batalla de Santa Mรณnica Fibrosis quรญstica Fortificaciones de Pamplona Artรญculo bueno Sarcoscypha coccinea Sarcoscypha coccinea Sarcoscypha coccinea, comรบnmente conocida como copica escarlata, es una especie de hongo de la familia Sarcoscyphaceae, del orden Pezizales. El hongo puede encontrarse en todos los continentes excepto en la Antรกrtida. Es la especie tipo del gรฉnero Sarcoscypha, la cual ha sido conocida con muchos nombres desde su primera apariciรณn en la literatura cientรญfica en 1772. El anรกlisis filogenรฉtico indica que la especie estarรญa muy relacionada con otras de Sarcoscypha que contienen numerosas gotitas de aceite en sus esporas, como la especie S. macaronesica, de las islas del Atlรกntico Norte. Leer Todos los artรญculos buenos Candidatos Anteriores: Lynyrd Skynyrd Deep Purple in Rock Sitta carolinensis Recurso del dรญa Hongo oronja Hongo oronja El oronja (Amanita caesarea) comรบnmente conocida como el hongo de Cรฉsar, es un hongo comestible muy apreciado del gรฉnero Amanita, originario del sur de Europa y el norte de รfrica. Su cuerpo fructรญfero se desarrolla entre el verano y otoรฑo, aunque crece mayormente en lugares con tormentas abundantes. Suele localizarse en regiones de clima mediterrรกneo en Europa. Muestra preferencia por los terrenos silรญceos y bosques aclarados, encontrรกndose principalmente bajo alcornoques, encinas, robles, castaรฑos y, ocasionalmente, conรญferas. Archivo Actualidad Guerras y conflictos: Generaciรณn Z (varios paรญses), Estados Unidos-Venezuela, Gaza-Israel, Rusia-Ucrania 14 de diciembre: Tiroteo en Bondi Beach 14 de diciembre: Segunda vuelta de las elecciones presidenciales de Chile 14 de diciembre: Mรกximo de las Gemรญnidas 12-21 de diciembre: Vuelta a Costa Rica 10-17 de diciembre: Copa Intercontinental de la FIFA 9-14 de diciembre: Campeonato Mundial de Clubes de Voleibol Femenino 26 de noviembre-14 de diciembre: Campeonato Mundial de Balonmano Femenino Fallecimientos 14 de diciembre: Kshamenk, orca argentina (32-34) 14 de diciembre: Eva Giberti, psicรณloga y psicoanalista argentina (96) 13 de diciembre: Bruno Baveni, futbolista y entrenador italia",
