    "content": "Jump to content From Wikipedia, the free encyclopedia West Germanic language English Pronunciation /หษชลษกlษชส/ ING-lish[1] Native to The English-speaking world, including the United Kingdom, United States, Canada, Australia, Ireland, New Zealand, Commonwealth Caribbean, South Africa and others Speakers L1: 380 million (2021)[2] L2: 1.077 billion (2021)[3] Total: 1.457 billion Language family Indo-European Germanic West Germanic North Sea Germanic Anglic English Early forms Proto-English Old English Middle English Early Modern English Dialects British English North American Caribbean Australian New Zealand South African Hiberno-English (full list) Writing system Latin (English alphabet) Anglo-Saxon runes (historical) English Braille, Unified English Braille Signed forms Manually coded English (multiple systems) Official status Official language in 57 countries and 30 dependent territories Organisations including the UN, EU, Commonwealth, ICC, IMF, IOC, ISO, NATO, WTO, ASEAN, OAS and OECD Language codes ISO 639-1 en ISO 639-2 eng ISO 639-3 eng Glottolog stan1293 Linguasphere 52-ABA Regions where English is the native language of the majority Regions where English is an official or widely spoken language, but not a majority native language This article contains IPA phonetic symbols. Without proper rendering support, you may see question marks, boxes, or other symbols instead of Unicode characters. For an introductory guide on IPA symbols, see Help:IPA. English is a West Germanic language that emerged in early medieval England and has since become a global lingua franca.[4][5][6] The namesake of the language is the Angles, one of the Germanic peoples who migrated to Britain after the end of Roman rule. English is the most spoken language in the world, primarily due to the global influences of the former British Empire (succeeded by the Commonwealth of Nations) and the United States. It is the most widely learned second language in the world, with more second-language speakers than native speakers. However, English is only the third-most spoken native language, after Mandarin Chinese and Spanish.[3] English is either the official language, or one of the official languages, in 57 sovereign states and 30 dependent territories, making it the most geographically widespread language in the world. In the United Kingdom, the United States, Australia, and New Zealand, it is the dominant language for historical reasons without being explicitly defined by law.[7] It is a co-official language of the United Nations, the European Union, and many other international and regional organisations. It has also become the de facto lingua franca of diplomacy, science, technology, international trade, logistics, tourism, aviation, entertainment, and the Internet.[8] Ethnologue estimated that there were over 1.4 billion speakers worldwide as of 2021[update].[3] Old English emerged from a group of West Germanic dialects spoken by the Anglo-Saxons. Early inscriptions were written with runes before a Latin-based alphabet was adopted for longer texts. Late Old English borrowed some grammar and core vocabulary from Old Norse, a North Germanic language.[9][10][11] An evolution of the Latin alphabet, the English alphabet, fully supplanted the runic alphabet by the High Middle Ages, coinciding with the emergence of Middle English in England under Norman control. Middle English borrowed vocabulary extensively from French dialects, which are the source of approximately 28 per cent of Modern English words, and from Latin, which is the source of an additional 28 per cent.[12] While Latin and the Romance languages are thus the source for a majority of its lexicon taken as a whole, English\u0027s grammar and phonology remain Germanic, as does most of its basic everyday vocabulary. Finally, Middle English transformed, in part through the Great Vowel Shift, into Modern English, which exists on a dialect continuum with Scots; it is next-most closely related to Low Saxon and Frisian. Classification English is a member of the Indo-European language family, belonging to the West Germanic branch of Germanic languages.[13] Owing to their descent from a shared ancestor language known as Proto-Germanic, English and other Germanic languages โ which include Dutch, German, and Swedish[14] โ have characteristic features in common, including a division of verbs into strong and weak classes, the use of modal verbs, and sound changes affecting Proto-Indo-European consonants known as Grimm\u0027s and Verner\u0027s laws.[15] Old English was one of several Ingvaeonic languages, which emerged from a dialect continuum spoken by West Germanic peoples during the 5th century in Frisia, on the coast of the North Sea. Old English emerged among the Ingvaeonic speakers on the British Isles following their migration there, while the other Ingvaeonic languages (Frisian and Old Low German) developed in parallel on the continent.[16] Old English evolved into Middle English, which in turn evolved i",
