    "content": "Jump to content From Wikipedia, the free encyclopedia English writer and critic (1741โ1810) Sarah Trimmer Portrait of Sarah Trimmer, 1798 Born (1741-01-06)6 January 1741 Ipswich, Suffolk, England Died 15 December 1810(1810-12-15) (aged 69) Brentford, London, England Occupation Writer Sarah Trimmer (nรฉe Kirby; 6 January 1741 โ 15 December 1810) was an English writer and critic of 18th-century British children\u0027s literature, as well as an educational reformer. Her periodical, The Guardian of Education, helped to define the emerging genre by seriously reviewing children\u0027s literature for the first time; it also provided the first history of children\u0027s literature, establishing a canon of the early landmarks of the genre that scholars still use today. Trimmer\u0027s most popular children\u0027s book, Fabulous Histories, inspired numerous children\u0027s animal stories and remained in print for over a century. Trimmer was also an active philanthropist. She founded several Sunday schools and charity schools in her parish. To further these educational projects, she wrote textbooks and manuals for women interested in starting their own schools. Trimmer\u0027s efforts inspired other women, such as Hannah More, to establish Sunday school programmes and to write for children and the poor. Trimmer\u0027s works are dedicated to maintaining many aspects of the social and political status quo. As a high church Anglican, she was intent on promoting the established Church of England and on teaching young children and the poor the doctrines of Christianity. Her writings outlined the benefits of social hierarchy, arguing that each class should remain in its God-given position. Yet, while supporting many of the traditional political and social ideologies of her time, Trimmer questioned others, such as those surrounding gender and the family. Early life [edit] Sarah Trimmer was born on 6 January 1741 in Ipswich, England, to Joshua Kirby and Sarah (nรฉe Bull); her father was a noted artist and served as president of the Society of Artists of Great Britain. Trimmer had one younger brother, William; she was apparently the better writer, for she would sometimes compose his school essays for him.[1] As a young girl, Trimmer attended Mrs. Justiner\u0027s boarding school in Ipswich, an experience she always remembered fondly.[2] In 1755, the family moved to London when her father, who had written several important works on perspective, became the tutor of perspective to the Prince of Wales.[3] Because of her father\u0027s connections within the artistic community, Trimmer was able to meet the painters William Hogarth and Thomas Gainsborough as well as the by-then legendary writer and critic Samuel Johnson. She made a favourable impression on Johnson when she immediately produced her pocket copy of John Milton\u0027s Paradise Lost (1667) to help settle a dispute between her father and Johnson over a particular passage. Johnson, delighted that she admired Milton enough to carry his works with her at all times, \"subsequently invited her to his house and presented her with a volume of his famous periodical The Rambler\".[4] In 1759, at the urging of his former pupil the Prince of Wales (soon to be George III), her father was made Clerk of the Works to the Royal Household at Kew Palace and the family moved to Kew.[5] There she met James Trimmer, whom she married on 20 September 1762 at St Mary, Ealing; after their marriage, the couple moved to Old Brentford.[6] Motherhood and philanthropy [edit] Sarah Trimmer\u0027s Sunday School in Brentford Trimmer was close to her parents; after her marriage, she walked to visit her father every day, later accompanied by her eldest children. She and her husband had 12 children in allโsix boys and six girls. Trimmer was responsible for her children\u0027s education and it was the combination of her duties as a mother and a teacher that initially sparked her interest in education.[7] Inspired by Robert Raikes, Trimmer also became active in the Sunday school movement, founding the first Sunday school for poor children in Old Brentford in 1786. She and two of the ministers in her parish, Charles Sturgess and Charles Coates, organized a fund drive and established several schools for the poor children of the neighbourhood.[8] Initially, five hundred boys and girls wanted to attend Trimmer\u0027s Sunday school; unable to accommodate such numbers, she decided to exclude those under five years of age and restricted each family to one pupil.[8] The parish set up three schools, each with about thirty studentsโone for older boys, one for younger boys and one for girls.[8] While some other educational reformers of the period such as Mary Wollstonecraft argued for co-educational instruction, Trimmer was opposed to such pedagogical changes; she believed in educating the sexes separately.[9] The students were taught to read, with the aim of teaching them to read the Bible. The students were also encouraged to keep cleanโ\"a present of a brush and comb was given to all who desire",
