    "content": "Jump to content From Wikipedia, the free encyclopedia This is a dynamic list and may never be able to satisfy particular standards for completeness. You can help by editing the page to add missing items, with references to reliable sources. v t e Sudanese civil war (2023โpresent) Prelude War in Darfur Sudanese revolution 2021 Sudanese coup d\u0027รฉtat 2023 Foro Baranga clashes Battles Khartoum Bahri offensive Khartoum airport Laboratory crisis Yarmouk airstrike Darfur campaign Geneina Nyala El Fasher Kutum Merowe Kordofan campaign El Obeid Kadugli Babanusa Al Fulah Dilling Wad Madani Sennar offensive Jebel Moya Al Maliha Gabal El Uweinat Drone attacks War crimes Atrocities in Khartoum Masalit genocide Ardamata Misterei Gezira State massacres Wad An Nora Galgani Civilian airstrikes Kabkabiya market Omdurman market Mayo Kadugli market Saudi hospital al-Kadaris and al-Khelwat Zamzam and Abu Shouk refugee camps Al Jamia mosque El Fasher massacre Humanitarian crisis Famine Refugee crisis El Fasher Forced deportation of Eritreans Evacuation of foreign nationals France India Germany Other Timelines 2023 2024 2025 Treaty of Jeddah (2023) Attempted assassination of Abdel Fattah al-Burhan 2024 Darfur Ilyushin Il-76 shootdown Destruction of cultural heritage during the Sudanese civil war 2025 IBM Airlines Boeing 737 incident The following is a timeline of the Sudanese civil war (2023โpresent) in 2025. This timeline is a dynamic and fluid list, and as such may never satisfy criteria of completeness. Moreover, some events may only be fully understood and/or discovered in retrospect. January [edit] 1 January [edit] The Joint Darfur Force (JDF) said it had killed 462 Rapid Support Forces (RSF) fighters including six commanders in a failed attack on Al-Malha, North Darfur. In addition, three vehicles were destroyed. The remaining unit under Ali Rizqallah Al-Safana retreated. The JDF also called on the RSF to surrender to the JDF or the Sudanese Armed Forces (SAF).[1] 2 January [edit] The SAF claimed that RSF brigadier general Ibrahim Delib was killed along with 32 RSF fighters, including a Mauritanian national, after a drone being launched by the group misfired in El Fasher.[2] 4 January [edit] Two people were killed by RSF shelling on the Saudi Hospital in El Fasher.[3] Four others were killed by RSF shelling in Omdurman.[4] 5 January [edit] Ten people were killed in an SAF airstrike in Khartoum.[5] The SAF and the JDF claimed to have deflected an RSF assault on El Fasher that came from the east and southeast of the city. The JDF also intercepted a weapons convoy for the RSF, arresting both Sudanese and Libyan nationals.[6] 7 January [edit] The United States officially declared that the RSF had committed genocide and imposed sanctions on Hemedti.[7] The SAF retook the administrative center of Ombadda as well as Al-Shagla and the western section of the Al-Fitaihab neighborhood of Omdurman from the RSF. It also claimed to have freed three captive officers in Al-Fitaihab in a special operation that left more than 20 RSF militants dead, including a commander.[8] Four people were killed in an SAF airstrike on the Fata Borno IDP camp in Kutum, North Darfur.[9] 8 January [edit] The SAF retook the town of Haj Abdallah in Gezira State, 58 kilometers from Wad Madani, and the village of Mahalla, 13 kilometers from Wad Madani, from the RSF.[10] 9 January [edit] The SAF retook the town of Al-Shabarqa in Gezira State, 13 kilometers east of Wad Madani, from the RSF.[11] 10 January [edit] The SAF retook the town of Um al-Qura in Gezira State, 40 kilometers east of Wad Madani, from the RSF, while the SAF-allied Sudan Shield Forces retook Wad al-Abyad, 20 kilometres from the Hantoub bridge.[12] At least 26 people were killed in an attack by the Sudan Shield Forces on the village of Tayba in Gezira State.[13] 11 January [edit] The SAF retook Wad Madani, the capital of Gezira State.[14] Sixteen people were killed by RSF shelling on the Zamzam IDP camp in North Darfur.[15] 12 January [edit] The SAF retook the Al-Rawad residential complex in Khartoum from the RSF.[16] 13 January [edit] At least 120 people were killed by shelling in western Omdurman.[17] The Merowe Dam power station was damaged by RSF drones, causing a fire at the facility and power outages as far as Shendi, Port Sudan, Atbara and Omdurman.[18] The SAF retook Karkaraia and Hajar al-Jawad, on the road between Dalang and Kadugli in South Kordofan, from the SPLM-N (al-Hilu).[19] Thirteen people were killed by the SAF and allied militias in an attack on the informal settlement of Kambo Tayba in Gezira State.[20] 14 January [edit] The JDF claimed to have killed hundreds of RSF militants, destroyed 262 vehicles, and captured 21 militants and 67 vehicles during clashes in Al-Malha and Halaf in North Darfur.[21] At least 18 people were killed in attacks by the Sudan Shield Forces on the Shukaba camp and Camp 16 in Gezira State.[22] 15 January [edit] At least 120 people were killed in an RSF",
