    "title": "Wikipetcia",
    "content": "Aller au contenu E pe otciparik Wikipetcia Wikipetcia Kwei kwei! Version pour appareil mobile Mekwata 2 077 tatino masinahikan Witcihici Nehirowicta Wiki Waskapiwin Groupe Facebook Le Bistro Wikipรฉdia (fr) Ke nanakatcitakaniwoki Discussions IRC chat (fr) \"Ki tci kaskeritakik iriniwok nikanik tan ka ki pe aisparinik otananik, tato kaki pe takickakotcik, tan ka ki ici takickakotcik, kekwariw ka pe irakonikaniwonik. Owe tca masinahikan ki tci witcihikotcik ke ici mickowisiwaketcik, ki tci kaskeritakik tan nte ke ici matcatcik, kecpin kekwariw e nakickakik, arimisiwiniw. Aka minawatc neta ki tci wi motatakik kekwariw kecpin aka e mirwacinik.\" โ Gilles Ottawa Atisokan Manawan/Wemotaci Awacak e atisokowakaniwitcik Weckatc esko pe atisokaniwok kekwan. Kotc ka pe kackitatc nictam iriniw kitci arimwetc, ekoni aspin esko ki pe tipatcimotc. Weckatc tca esko pe atisokaniwok kekwan. Nama mia kaskeritakon apitc ka matceparik atisokan. Takono tca kekwan ka atisokatcikateki, Kitci atisokan kirika atisokancic, keki itwaniwokipan. Kitci Atisokan e tipatcimonaniwok pimatisiwinik napitc. Atisokancica, nootc e kiskinohomakaniwok tan ke iti icinakok nikanik itekera pimatisiwinik. Arimwewin, kiskinohomakewin Apitc ka matceparinik ot arimwewin Iriniw, ki petako kotakihi witci iriniwa, ki kakeskinotako ani kaki mamo witci tacikemikotc. Nac eki iti kackitatcik kaskina e arimwetcik. Wipatc tca neta ki nokoniw, irikik kaki ici tatak, kitci ki arimwetc, kitci kiskinohomaketc kekwariw kecpin e tipatcimotc kekwariw. Mocak tca ki mina aitotam aka arotcikotc kitci itetc, kitci kaie maia witak kekwariw, aka kitci wi kiraskimatc awia, aka kaie kitci matci itatc ka witci icinakosimatc. Kekwariw ka itetc, ekoni tarasak e icinakonik, nama pitoc. Arimwewin, enko tca tepirak kaki tatok kitci ki kiskinohomakaniwok kekwan kaki pe aisparik weckatc, apitc kaki pe iciwepak, tan kaki pe icinakok kekwan, kaskina neta ki iti takoniw ke ici iti tipatcimotc iriniw, ot atisokan. Awin ka atisokasotc ? Wisaketcakw atisokan, Kokotce kekotc Witiko (Windigo) atisokan, Kinoce atisokan, Pitciw atisokan, Niketcotcinehon atisokan, Cikipic atisokan, Waskomiko iriniw atisokan, Awesis atisokan, Manito atisokan, Nictam pimatisiwin atisokan, Nipinatcac acitc Kiwetinisiw atisokan, Memekweciw atisokan, Namepirtehesiw atisokan, kirika kotakihi, mitceno. Awin ka atisoketc Iriniw nikickowew awaca Kitawok iriniwok kaie iskwewok e tipatcimotcik, ki atisokewok. Ani e tacitcik, nama kata ki itwaniwon, enko anowe ka mirowacinik ka itetc, ka acterik kitci atisoketc. Iskwew, okawinan, nictam e acterik kitci petakositc, apiciciriwa onitcanica acitca kotc e aiamiatc. Patoc wiskata, wir iriniw, otawinan, acteriw kitci aiamihatc onitcanica. Ekoni e ici nicitcik, okawinan acitc otawinan, nictam ke aiamihatcik, ke kiskinohomowatcik onitcaniciwawa. Kotakihi wirata awia tca matci kata ki iti kiskinohomako anowe awacic, irikik ke iti matceatisitc. E ici tcirowetotc, e ici ot otenowesimatc awia kata ki atisokako. Atisokaniw tca ki takoniw, tan kotc e iti tato piponesitc. Enkweriw ke nosonehokotc irikik ke iti matisitc, kaki ici kiskinohomowakaniwitc, aka soka kitci waneritak nakickake arimisiwiniw pimatisiwinik itekera. Picicikw e ki pitci witak kekwariw Iriniw, ki takoniw kaie e ki itasinahak kitci ki tipatcimotc, kitci kanaweritakonik atisokanik itekera. Asiniwa ki masinawapiskowew, wikwasik ki ici masinaham kekwariw kaki wi ici tipatcimotc, kinec kitci miparinik, warowik kitci icamakanik. Matcitaw tarasak ot atisokan kecpin e pitci tipatcimotc, posoweritam meka mocak kitci miparinik. Enkweriw ka apatcitatc witci iriniwa, onitcanica acitc awaca otci ke apatcitaritci. Ekota neta ot itewinik kaki ici nahikak, otitatisiwin, omitoneritcikan, ot asperimowin acitc ot irisowin. Enko okawinan ka atisokowatc onitcanica, otawinan ka witamowatc wi ockinima. Okominan kirika Omocominan ka kiskinohomowatcik osimiwawa. Otosinan, omicomecinan acitc otcirowemakanan, ka miwitatcik kiskinohomakewiniw acitc atisokaniw. Papie e tato otenowesinaniwok, ki tawok e ki micta kackitatcik e atisoketcik. Cakotc, ekoni kaie wirowaw kaki ici coweritakositcik. Aric ma, nictam onikihikonanak acteriw kitci atisokwatcik onitcaniciwawa. Irikik ke atisokwakaniwitc awacic, kirowe kata miro matcepariniw omitoneritcikan. Ekota ke otci matceparinik ite ke ici matawe iteritak. Kata miro witcihiko mocak atisokaniw. Nama soka tapickotc aicinakono atisokana, nama nikot, kirakec tapickotc icinakoke kiskinohamakewin neta ka actek. Atita pitoc icinikatakaniwiwok neta ka atisokasotcik, mitowi ยซPitciw atisokanยป acitc ยซAhac atisokanยป. Takon awesis atisokan Kekwan ka ki atisokaniwok Kitci atisokan ka itwaniwok, irin pimatisiwinik itekera tipatcimonaniwon. Ka kicapewitcik acitc peikon ka iti matceatisitcik, ockinikiwok, atisokatakaniwiwok. Awesisa kitci kiskerimatcik, tan e itatikosiritci, e aicinikateki askik kekwan aka kitci onicinitcik notcimik, tan ke ici nanakatcitatcik e ici rowerik, ite otci rowerik. Onimiskiwa e kitoritci, atcokoca it",
