    "content": "Jump to content From Wikipedia, the free encyclopedia US policemen enforcing federal laws on natives A Southern Cheyenne Indian policeman, c.โ1889 Indian agency police were policemen hired by the United States governmentโs Indian agents during the late 19th and early 20th century, it was assigned to members of American Indian tribes. It was the duty of Indian agency police to enforce federal laws, the laws of the state where their reservation was located, and the terms of the federal treaties with their tribal authority. The very first Indian police made their appearance in the Great Plains in the 1830s. This was partly due to the relocation of tribes such as the Cherokee into Indian territories.[1] Many tribes had no recognizable governments and therefore no tribal laws. On these tribes\u0027 reservations, the Indian agent hired tribal members to effect law and order according to federal, agency, and treaty rules. Some tribes, such as the Cherokee, had well-developed systems of tribal laws and tribal courts; the agency police also enforced these laws, and they testified and maintained order in the tribal courts. Since the agency police were federal officers, crimes against them had to be tried in a United States district court. Indian policemen had a wide range of responsibilities, such as maintaining law and order, protecting agency property, arresting offenders, managing jails, and serving as messengers. They also patrolled reservation boundaries, detaining thieves and enforcing various bans.[1] They often faced danger, with at least twenty-four officers losing their lives in Indian Territory (modern day-Oklahoma) alone between 1876 and 1906. The deadliest incident occurred on December 15, 1890, when six members of Standing Rock\u0027s Indian police force were killed while trying to apprehend Sitting Bull. Members of the Indian agency police were also responsible for the death of Sitting Bull and 12 other American Indians.[1][2] See also [edit] Australian native police Indian tribal police Lighthorse (American Indian police) Sitting Bull United States Indian Police Bureau of Indian Affairs Police References [edit] ^ a b c \"Encyclopedia of the Great Plains | INDIAN POLICE\". plainshumanities.unl.edu. Retrieved 2023-05-23. ^ \"Sitting Bull killed by Indian police\". HISTORY. 16 November 2009. Retrieved 2023-05-23. Bureau of Indian Affairs. Indian Law Enforcement History. Republished at Tribal Court Clearinghouse from original published by Bureau of Indian Affairs and archived at Archive.org Ellis, Mark R. \"Indian Police\", Encyclopedia of the Great Plains. University of NebraskaโLincoln, 2011. Remington, Frederic, \"On the Indian Reservations\". The Century, Vol. 38, Issue 4, August 1889, pp 536โ545. Indian Affairs: Laws and Treaties. Vol. I, Laws (Compiled to December 1, 1902). This article relating to the history of the United States is a stub. You can help Wikipedia by expanding it. v t e Retrieved from \"https://en.wikipedia.org/w/index.php?title\u003dIndian_agency_police\u0026oldid\u003d1327379582\" Categories: History of the American West Native American tribal police United States Bureau of Indian Affairs personnel United States history stubs Hidden categories: Articles with short description Short description matches Wikidata All stub articles Search Search Indian agency police 2 languages Add topic",
