    "content": "Jump to content From Wikipedia, the free encyclopedia American football player and coach (1909โ1960) Frank Deig Deig in 1948 Biographical details Born c.โ1909 (1909) Black Township, Indiana, U.S. Died October 28, 1960(1960-10-28) (aged 50) Mower County, Minnesota, U.S. Playing career Football 1928โ1930 Marquette Position Fullback Coaching career (HC unless noted) Football 1934โ1936 St. Augustine HS (MN) 1937โ1945 Saint Thomas Academy (MN) 1946โ1957 St. Thomas (MN) Basketball 1934โ1937 St. Augustine (MN) 1937โ1940 Saint Thomas Academy (MN) 1940โ1946 St. Thomas (MN) Administrative career (AD unless noted) 1941โ1958 St. Thomas (MN) Head coaching record Overall 57โ36โ2 (college football) Bowls 0โ0โ1 Accomplishments and honors Championships Football 4 MIAC (1947โ1949, 1956) Francis J. Deig (c. 1909 โ October 28, 1960) was an American athlete and sports coach. He served as the head football coach at the University of St. Thomas from 1946 to 1957, the head basketball coach at St. Thomas from 1940 to 1946, and the athletic director of St. Thomas from 1941 to 1958. He played college football at Marquette University. Early life and education [edit] Francis J. Deig was born in c. 1909 and grew up in the Mount Vernon, Indiana, area.[1][2] He first attended St. Matthew Parochial School before transferring to Mount Vernon High School.[2] He later transferred a second time to Jasper Academy, where he starred in football, basketball, and baseball.[2] He had a batting average of .484 as a senior at Jasper Academy, a record that was still standing by 1949.[2] After graduating from there, Deig enrolled at Marquette University.[2] He played football at Marquette and reportedly earned All-American honors as well as All-Western honors.[2] At Marquette, he played from 1928 to 1930 as a fullback,[3][4] gaining a reputation as a hard-hitter.[5] As a senior in 1930, he scored five touchdowns and placed second on the team in scoring with 30 points.[3][4] At the conclusion of his collegiate career, he was selected for the Dixie Classic all-star game.[2] According to The Minneapolis Star, Deig was considered one of Marquette\u0027s greatest fullbacks.[6] His fame at Marquette led to him receiving a position at a Milwaukee restaurant.[6] According to the Star, there, His duties were to visit the cafe each day, sit at a center table, order, and eat. It was also stipulated that Deig had to eat with relish and with gusto, including polite smacking of the lips and long, contented sighs ... And โ emblazoned all over the glittering restaurant front was this sign: \"DEIG EATS HERE.\"[6] Coaching career [edit] Deig joined St. Augustine High School in 1934, coaching their football and basketball teams.[7][8][9] The 1935 football team went undefeated and scored 275 points, the highest among state high schools.[10][11] A 1936 article in the Star Tribune wrote \"Down at Austin they are mighty proud of the St. Augustine high school team ... The team is coached by Francis Deig, former Marquette university end [sic][a] who won All-American mention four years ago. All of the townspeople are talking about it. The team is big and experienced. Deig has been working on his present squad for three years and many say it is one of the best coached they have ever seen.\"[12] In 1937, Deig became a coach and physical education faculty at Saint Thomas Academy.[6][13] Through October 1937, he had won 24 straight games as a coach, including his time at St. Augustine.[8] He served as head basketball coach at Saint Thomas until 1940 and as head football coach through 1945.[14][15] His football team compiled a record of 52โ11โ7, winning six conference championships.[15] Deig and Jack Salscheider with the Cigar Bowl trophy in 1949 In 1940, Deig was appointed the athletic director and head basketball coach at the University of St. Thomas, replacing Nic Musty, whose resignation went into effect at the start of 1941.[14] By the start of 1946, his record as head basketball coach was 71โ28.[15] In January 1946, he was named head football coach as well.[15] The 1946 St. Thomas football team went 4โ3, placing second in the Minnesota Intercollegiate Athletic Conference (MIAC).[16] In just his second year with the football team, Deig led them to the conference championship.[2] He led them to the championship again in 1948 and for a third consecutive year in 1949, also helping them achieve a Cigar Bowl berth in 1949.[2][16] The Cigar Bowl invitation was the first bowl invite ever for a team in the MIAC.[2] In 1956, he led St. Thomas to a fourth MIAC championship with an undefeated 8โ0 record.[16] He resigned in 1958.[17][18][19] Deig received a Bachelor of Arts from St. Thomas in 1941. By the end of his coaching career, he held the school wins record and was the only coach in team history to have won four MIAC championships. His undefeated 1956 season earned him National Catholic Small College Coach of the Year honors. Deig was inducted into the University of St. Thomas Athletics Hall o",
