    "content": "Jump to content Coordinates: 18ยฐS 158ยฐE๏ปฟ / ๏ปฟ18ยฐS 158ยฐE๏ปฟ / -18; 158 From Wikipedia, the free encyclopedia Marginal sea of the South Pacific off the northeast coast of Australia For other uses, see Coral Sea (disambiguation). Coral Sea Coordinates 18ยฐS 158ยฐE๏ปฟ / ๏ปฟ18ยฐS 158ยฐE๏ปฟ / -18; 158 Type Sea Basin countries Australia France (New Caledonia) Papua New Guinea Solomon Islands Vanuatu Surface area 4,791,000 km2 (1,850,000 sq mi) Average depth 2,394 m (7,854 ft) Max. depth 9,140 m (29,990 ft) Water volume 11,470,000 km3 (9.30ร1012 acreโft) Settlements Brisbane, Gold Coast, Sunshine Coast, Port Moresby, Cairns, Townsville, Noumรฉa, Port Vila References [1][2] Interactive map of Coral Sea Map all coordinates using OpenStreetMap Download coordinates as KML The Coral Sea (French: Mer de Corail) is a marginal sea of the South Pacific off the northeast coast of Australia, and classified as an interim Australian bioregion. The Coral Sea extends 2,000 kilometres (1,200 mi) down the Australian north-east coast to latitude 30ยฐ south.[3] Most of it is protected by the French Natural Park of the Coral Sea (French: Parc Naturel de la Mer de Corail) and the Australian Coral Sea Marine Park. The sea was the location for the Battle of the Coral Sea, a major confrontation during World War II between the navies of the Empire of Japan, and the United States and Australia. The sea contains numerous islands and reefs (hence the name), as well as the world\u0027s largest reef system, the Great Barrier Reef (GBR), which was declared a World Heritage Site by UNESCO in 1981. All previous oil exploration projects were terminated at the GBR in 1975, and fishing is restricted in many areas. The reefs and islands of the Coral Sea are particularly rich in birds and aquatic life and are a popular tourist destination, both domestically and internationally. Geography [edit] It is bounded in the west by the east coast of Queensland, thereby including the Great Barrier Reef, in the east by Vanuatu (formerly the New Hebrides) and by New Caledonia, and in the northeast approximately by the southern extremity of the Solomon Islands. In the northwest, it reaches to the south coast of eastern New Guinea, thereby including the Gulf of Papua. It merges with the Tasman Sea in the south, with the Solomon Sea in the north and with the Pacific Ocean in the east. On the west, it is bounded by the mainland coast of Queensland, and in the northwest, it connects with the Arafura Sea through the Torres Strait.[2] The sea is characterised by its warm climate, with frequent rains and tropical cyclones. Extent [edit] A map of the Coral Sea Islands While the Great Barrier Reef with its islands and cays belong to Queensland, most reefs and islets east of it are part of the Coral Sea Islands Territory. In addition, some islands west of and belonging to New Caledonia are also part of the Coral Sea Islands in a geographical sense, such as the Chesterfield Islands and Bellona Reefs. The International Hydrographic Organization defines the limits of the Coral Sea as follows:[4] On the North. The South coast of New Guinea from the entrance to the Bensbach River (141ยฐ01\u0027E) to Gadogadoa Island near its Southeastern extreme ( 10ยฐ38โฒS 150ยฐ34โฒE๏ปฟ / ๏ปฟ10.633ยฐS 150.567ยฐE๏ปฟ / -10.633; 150.567), down this meridian to the 100 fathom line and thence along the Southern edges of Uluma Reef and those extending to the Eastward as far as the Southeast point of Lawik Reef ( 11ยฐ43.5โฒS 153ยฐ56.5โฒE๏ปฟ / ๏ปฟ11.7250ยฐS 153.9417ยฐE๏ปฟ / -11.7250; 153.9417) off Tagula Island, thence a line to the Southern extreme of Rennell Island (Solomon Islands) and from its Eastern point to Cape Surville, the Eastern extreme of San Cristobal Island [Makira], Solomons; thence through Nupani Island, the Northwestern of the Santa Cruz Islands ( 10ยฐ04.5โฒS 165ยฐ40.5โฒE๏ปฟ / ๏ปฟ10.0750ยฐS 165.6750ยฐE๏ปฟ / -10.0750; 165.6750) to the Northernmost Island of the Duff Islands ( 9ยฐ48.5โฒS 167ยฐ06โฒE๏ปฟ / ๏ปฟ9.8083ยฐS 167.100ยฐE๏ปฟ / -9.8083; 167.100). On the Northeast. From the Northernmost island of the Duff Islands, through these islands to their Southeastern extreme, thence a line to Mรฉrรฉ Lava, Vanuatu Islands( 14ยฐ25โฒS 163ยฐ03โฒE๏ปฟ / ๏ปฟ14.417ยฐS 163.050ยฐE๏ปฟ / -14.417; 163.050) and down the Eastern coasts of the islands of this Group to Anatom Island ( 20ยฐ11โฒS 169ยฐ51โฒE๏ปฟ / ๏ปฟ20.183ยฐS 169.850ยฐE๏ปฟ / -20.183; 169.850) in such a way that all the islands of these Groups, and the straits separating them, are included in the Coral Sea. On the Southeast. A line from the Southeastern extreme of Anatom Island to Nokanhoui (reefs) ( 22ยฐ46โฒS 167ยฐ34โฒE๏ปฟ / ๏ปฟ22.767ยฐS 167.567ยฐE๏ปฟ / -22.767; 167.567) off the Southeast extreme of New Caledonia, thence through the East point of Middleton Reef to the Eastern extreme of Elizabeth Reef ( 29ยฐ55โฒS 159ยฐ02โฒE๏ปฟ / ๏ปฟ29.917ยฐS 159.033ยฐE๏ปฟ / -29.917; 159.033) and down this meridian to Latitude 30ยฐ South. On the South. The parallel of 30ยฐ South to the Australian coast. (Bordering the Tasman Sea.) On the West. The Eastern limit of the Arafura Sea [The ent",
