    "url": "https://en.wikipedia.org/wiki/Pablo_Rodr%C3%ADguez_Grez",
    "title": "Pablo Rodrรญguez Grez - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Chilean politician (1937โ2025) Pablo Rodrรญguez Grez Leader of Fatherland and Liberty Nationalist Front In office 1 April 1971 โ 13 September 1973 Preceded by Created movement Succeeded by Dissolved movement Personal details Born (1937-12-20)20 December 1937 Santiago, Chile Died 9 December 2025(2025-12-09) (aged 87) Party National Advance Other political affiliations National Action Movement (1983โ1987) Fatherland and Liberty (1971โ1973) Pablo Rodrรญguez Grez[a] (20 December 1937 โ 9 December 2025) was a Chilean politician and lawyer. He supported and was a lawyer for Augusto Pinochet. Rodrรญguez became known for his authoritarian ideals and for founding the Fatherland and Liberty movement, in which he had been accused of terrorist acts, in addition to collaborating with Pinochet\u0027s coup in 1973. He was also a candidate for the National Advance party for the presidency of Chile in 1989. Rodrรญguez was a lecturer in civil law at the University of Chile\u0027s faculty of law from 1978 and was a partner at the law firm Rodrรญguez Vergara y Compaรฑรญa. Early life [edit] Rodrรญguez was born on 20 December 1937, in the capital Santiago. In 1956, his father, Manuel Rodrรญguez Valenzuela (es), a former education minister, killed himself after an investigation by the comptroller general.[1] He graduated in legal and social sciences in 1960 from the faculty of law at the University of Chile, then received his law degree in 1962.[2][3] He also received the Pedro Nicolรกs Montenegro award in 1960.[4] Political life [edit] Rodrรญguez was a strong opponent of Salvador Allende. In 1970, alongside right-wing youth figures such as Jaime Guzmรกn, he founded the Comitรฉ Cรญvico Patria y Libertad, a committee designed to prevent Allende\u0027s election. Some of the committee\u0027s ideals, such as anti-communism and opposition to the UP, served as inspiration for the Fatherland and Liberty party.[5][6] These groups generally had nationalist ideals and connections to the armed forces, such as the Juventud Anticomunista de Chile.[7] Fatherland and Liberty [edit] Rodrรญguez founded the Fatherland and Liberty party on 1 April 1971, at an event at the stadium Nathaniel in the heart of the capital, later becoming head.[8] It emerged as an opposition to the government of Salvador Allende and which had supposed support from the CIA.[9] He preached nationalist and fascist ideals (especially Italian fascism) and that Congress, along with the country\u0027s traditional parties, were responsible for the economic crisis.[10] The movement did not have many members, but it had some power in politics. The movement carried out terrorist acts and sabotage against the Allende government, such as the murder of Arturo Araya Peeters (es).[11] They attempted a strike in 1972, but failed. The movement had contact with Armored Regiments (Nยบ2), in which they attempted a coup in June 1973, with tanks in the streets and bomb attacks, in which it became known as โTanquetazoโ, which was also unsuccessful.[5][12][13] After the failed coup attempt, he and other officials sought asylum at the Ecuadorian embassy: he lived in Quito for two months before returning to Chile clandestinely from Argentina.[14][15] Military dictatorship [edit] Rodrรญguez dissolved the movement after Pinochet\u0027s coup in 1973. He tried to gain Pinochet\u0027s trust, even though he disagreed with the economic policy adopted, which was liberal and he was corporatist.[16] Pinochet ignored much of Rodrรญguez\u0027s advice and did not have much influence on the regime, even though he played a leading role in the coup that toppled Allende. He advised Pinochet not to respect the courts and crack down on Christian Democracy, saying that his supporters wanted the Junta Militar to fail and that the University of Chile became an \"umbrella for Christian Democracy.\" He expressed his loyalty to the regime after saying: \"I am the most modest soldier, the most humble, but the most loyal to this cause\" and that: \"our position is one of absolute and unconditional support for the government\".[17] In 1983, Rodrรญguez, Federico Willoughby-MacDonald (es) and Gastรณn Acuรฑa founded the National Action Movement (es) (MAN), after the political opening in 1983 by minister Sergio Onofre Jarpa. In 1987, the MAN disbanded after leader Willoughby-MacDonald left the party.[18] 1989 presidential candidate [edit] Between 1988 and 1989 he tried to be a candidate for the presidency in the presidential elections by National Advance, in which he hoped to receive the support of the government, but he failed after the lack of support from sectors of the right (especially UDI and RN) and the government, in which he supported the candidacy of Hernรกn Bรผchi.[19] After Patricio Aylwin\u0027s victory in the 1989 election, Pinochet called an urgent meeting in La Moneda with various officials, including Rodrรญguez. He showed Pinochet a typewriter and stated that he could write a letter to render Aylwin\u0027s election null and void. Pinoche",
