    "content": "Jump to content Coordinates: 51ยฐ10โฒ44โณN 1ยฐ49โฒ34โณW๏ปฟ / ๏ปฟ51.17889ยฐN 1.82611ยฐW๏ปฟ / 51.17889; -1.82611 From Wikipedia, the free encyclopedia Prehistoric monument in England For other uses, see Stonehenge (disambiguation). Stonehenge Stonehenge in July 2007 Stonehenge Map of Wiltshire showing the location of Stonehenge Location Wiltshire, England Region Salisbury Plain Coordinates 51ยฐ10โฒ44โณN 1ยฐ49โฒ34โณW๏ปฟ / ๏ปฟ51.17889ยฐN 1.82611ยฐW๏ปฟ / 51.17889; -1.82611 Type Monument Height Each standing stone was around 13 ft (4.0 m) high History Material Sarsen, Bluestone Founded Neolithic and Bronze Age Site notes Excavation dates Multiple Ownership The Crown Estate Management English Heritage Website www.english-heritage.org.uk/stonehenge UNESCO World Heritage Site Type Cultural Criteria i, ii, iii Designated 1986 (10th session) Part of Stonehenge, Avebury and Associated Sites Reference no. 373 Region Europe and North America Scheduled monument Official name Stonehenge, the Avenue, and three barrows adjacent to the Avenue forming part of a round barrow cemetery on Countess Farm[1] Designated 18 August 1882; 143 years ago (1882-08-18) Reference no. 1010140[1] Stonehenge is a prehistoric megalithic structure on Salisbury Plain in Wiltshire, England, two miles (3 km) west of Amesbury. It consists of an outer ring of vertical sarsen standing stones, each around 13 feet (4.0 m) high, seven feet (2.1 m) wide, and weighing around 25 tons, topped by connecting horizontal lintel stones which are held in place with mortise and tenon jointsโa feature unique among contemporary monuments.[2][3] Inside is a ring of smaller bluestones. Inside, these are free-standing trilithons, two bulkier vertical sarsens joined by a single lintel. The whole monument, now in ruins, is aligned towards the sunrise on the summer solstice and sunset on the winter solstice. The stones are set within earthworks in the middle of the densest complex of Neolithic and Bronze Age monuments in England, including several hundred tumuli (burial mounds).[4] Stonehenge was constructed in several phases beginning about 3100 BC and continuing until about 1600 BC. The famous circle of large sarsen stones was placed between 2600 BC and 2400 BC. The surrounding circular earth bank and ditch, which constitute the earliest phase of the monument, have been dated to about 3100 BC. Radiocarbon dating suggests that the bluestones were given their current positions between 2400 and 2200 BC,[5] although they may have been at the site as early as 3000 BC.[6][7][8] One of the most famous landmarks in the United Kingdom, Stonehenge is regarded as a British cultural icon.[9] It has been a legally protected scheduled monument since the Ancient Monuments Protection Act 1882 was passed.[1] The site and its surroundings were added to UNESCO\u0027s list of World Heritage Sites in 1986. Stonehenge is owned by the Crown Estate and managed by English Heritage; the surrounding land is owned by the National Trust.[10][11] Stonehenge could have been a burial ground from its earliest beginnings.[12] Deposits containing human bone date from as early as 3000 BC, when the ditch and bank were first dug, and continued for at least another 500 years.[13] Etymology Watercolour of Stonehenge by Lucas de Heere, 1574[a] The Oxford English Dictionary cites รlfric\u0027s 10th-century glossary, in which henge-cliff is given the meaning \u0027precipice\u0027, or stone; thus, the stanenges or Stanheng \"not far from Salisbury\" recorded by 11th-century writers are \"stones supported in the air\". In 1740, William Stukeley notes: \"Pendulous rocks are now called henges in Yorkshire ... I doubt not, Stonehenge in Saxon signifies the hanging stones.\"[16] Christopher Chippindale\u0027s Stonehenge Complete gives the derivation of the name Stonehenge as coming from the Old English words stฤn \u0027stone\u0027, and either hencg \u0027hinge\u0027 (because the stone lintels hinge on the upright stones) or hen(c)en \u0027to hang\u0027 or \u0027gallows\u0027 or \u0027instrument of torture\u0027 (though elsewhere in his book, Chippindale cites the \u0027suspended stones\u0027 etymology).[17] The \"henge\" portion has given its name to a class of monuments known as henges.[16] Archaeologists define henges as earthworks consisting of a circular banked enclosure with an internal ditch.[18] As often happens in archaeological terminology, this is a holdover from antiquarian use. Early history Plan of Stonehenge in 2004. After Cleal et al. and Pitts. Italicised numbers in the text refer to the labels on this plan. Trilithon lintels omitted for clarity. Holes that no longer, or never, contained stones are shown as open circles. Stones visible today are shown coloured. Mike Parker Pearson, leader of the Stonehenge Riverside Project based around Durrington Walls, noted that Stonehenge appears to have been associated with burial from the earliest period of its existence: Stonehenge was a place of burial from its beginning to its zenith in the mid third [sic] millennium B.C. The cremation burial dating to Stonehenge\u0027s sarsen stones p",
